	add("concatenation", "{\"term\":\"concatenation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A series of links united; a series or order of things depending on each other, as if linked together; a chain, a succession\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1927\u0027\u0027, Albert Einstein, as quoted by H. G. Kessler in \u0027The Diary of a Cosmopolitan\u0027 (1971\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Try and penetrate with our limited means the secrets of nature and you will find that, behind all the discernible \u0027\u0027concatenations\u0027\u0027, there remains something subtle, intangible and inexplicable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The application of these series of links\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The operation of joining multiple character strings\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A character string formed by joining multiple character strings\", \"priority\":6}]}, \"synonyms\":{}}");

