	add("conceit", "{\"term\":\"conceit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Apparently formed from \u0027\u0027 by analogy with \u0027\u0027 \u0027\u0027 \u0027\u0027 \u0027\u0027 etc.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something conceived in the mind; an idea, a thought\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In laughing, there ever procedeth a \u0027\u0027conceit\u0027\u0027 of somewhat ridiculous\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bible, Proverbs xxvi. 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a man wise in his own \u0027\u0027conceit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The faculty of conceiving ideas; mental faculty; apprehension\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a man of quick \u0027\u0027conceit\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"How often, alas! did her eyes say unto me that they loved! and yet I, not looking for such a matter, had not my \u0027\u0027conceit\u0027\u0027 open to understand them\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Quickness of apprehension; active imagination; lively fancy\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"His wit\u0027s as thick as Tewksbury mustard; there is no more \u0027\u0027conceit\u0027\u0027 in him than is in a mallet\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Opinion, (neutral) judgment\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Esteem, favourable opinion\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1499\u0027\u0027, \u0027The Bowge of Courte\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"By him that me boughte, than quod Dysdayne, / I wonder sore he is in suche \u0027\u0027cenceyte\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A novel or fanciful idea; a whim\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"L\u0027Estrang\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"On his way to the gibbet, a freak took him in the head to go off with a \u0027\u0027conceit\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Some to \u0027\u0027conceit\u0027\u0027 alone their works confine, / And glittering thoughts struck out at every line\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Tasso is full of \u0027\u0027conceits\u0027\u0027 which are not only below the dignity of heroic verse but contrary to its nature\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"An ingenious expression or metaphorical idea, especially in extended form or used as a literary or rhetorical device\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Overly high self-esteem; vain pride; hubris\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Cotto\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"Plumed with \u0027\u0027conceit\u0027\u0027 he calls aloud\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Design; pattern\", \"priority\":28}]}, \"synonyms\":{}}");

