	add("concentration", "{\"term\":\"concentration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concentrate|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act, process or ability of concentrating; the process of becoming concentrated, or the state of being concentrated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The direction of attention to a specific object\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act, process or product of reducing the volume of a liquid, as by evaporation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act or process of removing the dress of ore and of reducing the valuable part to smaller compass, as by currents of air or water\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A field or course of study on which one focuses, especially as a student in a college or university\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The proportion of a substance in a whole\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/4/solvents-ethanol-car-crashes-amp-tolerance Solvents, Ethanol, Car Crashes \u0026amp; passage\u003dSurprisingly, this analysis revealed that acute exposure to solvent vapors at \u0027\u0027concentrations\u0027\u0027 below those associated with long-term effects appears to increase the risk of a fatal automobile accident. Furthermore, this increase in risk is comparable to the risk of death from leukemia after long-term exposure to benzene, another solvent, which has the well-known property of causing this type of cancer\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The amount of solute in a solution measured in suitable units (e.g., parts per million (ppm\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The matching game pelmanism\", \"priority\":9}]}, \"synonyms\":{}}");

	add("concept", "{\"term\":\"concept\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Middle french (ca. 1400-1600) from Latin \u0027conceptus\u0027 (a thought, purpose, also a conceiving, etc.) from \u0027concipere\u0027 present active infinitive of \u0027concipiō\u0027 (to take in, conceive) see conceive.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An understanding retained in the mind, from experience, reasoning and/or imagination; a generalization (generic, basic form), or abstraction (mental impression), of a particular set of instances or occurrences (specific, though different, recorded manifestations of the concept\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;!--From Webster 1913--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Frege\u0027s concepts are very nearly propositional functions in the modern sense. Frege explicitly recognizes them as functions. Like Peirce\u0027s rhema, a concept is \u0027unsaturated\u0027. They are in some sense incomplete. Although Frege never gets beyond the metaphorical in his description of the incompleteness of concepts and other functions, one thing is clear: the distinction between objects and functions is the main division in his metaphysics. There is something special about functions that makes them very different from objects\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003dRace volume\u003d100|issue\u003d2|page\u003d164|magazine\u003d|url\u003dhttp://www.americanscientist.org/bookshelf/pub/race-finished|passage\u003dFew \u0027\u0027concepts\u0027\u0027 are as emotionally charged as that of race. The word conjures up a mixture of associations—culture, ethnicity, genetics, subjugation, exclusion and persecution. But is the tragic history of efforts to define groups of people by race really a matter of the misuse of science, the abuse of a valid biological \u0027\u0027concept\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; In generic programming, a description of supported operations on a type, including their syntax and semantics\", \"priority\":5}]}, \"synonyms\":{}}");

