	add("conception", "{\"term\":\"conception\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|conceptioun}}, from Old french (842-ca. 1400) {{m|fro|conception}}, from Latin \u0027conceptio\u0027 (a comprehending, a collection, composition, an expression, also a becoming pregnant) from {{m|la|concipere}}, past participle \u0027conceptus\u0027 (conceive) see conceive.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of conceiving\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being conceived; the beginning\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The fertilization of an ovum by a sperm to form a zygote\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The start of pregnancy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The formation of a conceptus or an implanted embryo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The power or faculty of apprehending of forming an idea in the mind; the power of recalling a past sensation or perception; the ability to form mental abstractions\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An image, idea, or notion formed in the mind; a concept, plan or design\", \"priority\":7}]}, \"synonyms\":{}}");

