	add("conceptualism", "{\"term\":\"conceptualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conceptual|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art movement towards conceptual art\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A theory, intermediate between realism and nominalism, that the mind has the power of forming for itself general conceptions of individual or single objects\", \"priority\":2}]}, \"synonyms\":{}}");

	add("concernment", "{\"term\":\"concernment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concern|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being a concer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That in which one is concerned or interested; concern; affair; interest\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I. Watt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Our everlasting \u0027\u0027concernments\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"To mix with thy \u0027\u0027concernments\u0027\u0027 I desist\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"importance; moment; consequenc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Jeremy Taylo\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Let every action of \u0027\u0027concernment\u0027\u0027 be begun with prayer\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"concern; participation; interpositio\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Clarendo\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"He married a daughter to the earl without any other approbation of her father or \u0027\u0027concernment\u0027\u0027 in it, than suffering him and her come into his presence\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"emotion of mind; solicitude; anxiet\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"While they are so eager to destroy the fame of others, their ambition is manifest in their \u0027\u0027concernment\", \"priority\":15}]}, \"synonyms\":{}}");

	add("concertato", "{\"term\":\"concertato\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An early Baroque genre or style of music in which groups of instruments or voices share a melody, usually in alternation, and almost always over a basso continuo\", \"priority\":1}]}, \"synonyms\":{}}");

	add("concertina", "{\"term\":\"concertina\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A musical instrument, like the various accordions, that is a member of the free-reed family of musical instruments, typically having buttons on both ends\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dThat \u0027\u0027concertina\u0027\u0027 was a wonder in its way. The handles that was on it first was wore out long ago, and he\u0027d made new ones of braided rope yarn. And the bellows was patched in more places than a cranberry picker\u0027s overalls\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something resembling a concertina, such as a folded book, a bus door or a set of picture frames that are folded together\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Coiled barbed wire for use as an obstacle.\u0026lt;ref\u0026gt;Webster\u0027s New Dictionary And Thesaurus, Geddes \u0026amp; Grosset Ltd., New Lanark, Scotland 1990\u0026lt;/ref\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of booklet label, consisting of up to 32 pages of booklet as an insert\", \"priority\":5}]}, \"synonyms\":{}}");

