	add("concession", "{\"term\":\"concession\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Late Middle english (1100-1500) from Middle french (ca. 1400-1600) from Latin \u0027concessionem\u0027 () accusative singular of \u0027concessio\u0027 (lang\u003dla) from \u0027concedo\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of conceding, especially that of defea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"something, such as an argument, that is conceded or admitted to be wron\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Admitting a point to strengthen one\u0027s overall case\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the grant of some land to be used for a specified purpos\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a contract to operate a small business as a subsidiary of a larger company, or within the premises of some institution; the business itself and the space from which it operate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In Ontario, a small road between tracts of farmland\", \"priority\":6}]}, \"synonyms\":{}}");

	add("concessionary", "{\"term\":\"concessionary\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concession|ary|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one who owns a concession or a franchis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1890,\u0027\u0027 Benjamin Harrison, \u0027State of the Union Address\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That Government seized the Delagoa Bay Railway, which was constructed under a concession granted to an American citizen, and at the same time annulled the charter. The \u0027\u0027concessionary\u0027\u0027, who had embarked his fortune in the enterprise, having exhausted other means of redress, was compelled to invoke the protection of his Government\", \"priority\":3}]}, \"synonyms\":{}}");

