	add("conciliarism", "{\"term\":\"conciliarism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine that the highest ecclesiastical authority is a church council (rather than a pope\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conciliarist", "{\"term\":\"conciliarist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|conciliar|ist|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A believer in conciliarism; someone who thinks the highest authority of the Church is found in ecclesiastical councils\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 561\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Conciliarists\u0027\u0027 never achieved consensus as to how to define the Church or account for the authority of a council\", \"priority\":3}]}, \"synonyms\":{}}");

	add("conciliarity", "{\"term\":\"conciliarity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The adherence of various Christian communities to the authority of ecumenical councils and to synodal church government\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conciliatoriness", "{\"term\":\"conciliatoriness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being conciliatory\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conciseness", "{\"term\":\"conciseness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concise|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being concise, succinctness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("concision", "{\"term\":\"concision\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) French|concision\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Conciseness, brevity or terseness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A form of media censorship where discussions are limited in topics on the basis of broadcast time allotments\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A cutting off; a division; a schism or faction\", \"priority\":3}]}, \"synonyms\":{}}");

	add("conclave", "{\"term\":\"conclave\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French from Latin \u0027conclave\u0027 (room that may be locked up) from \u0027con-\u0027 (combining form of \u0027cum\u0027 (with) + {{m|la|clāvis||key}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The set of apartments within which the cardinals of the Roman Catholic Church are continuously secluded while engaged in choosing a pope\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The group of Roman Catholic cardinals locked in a conclave until they elect a new pope; the body of cardinals\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was said a cardinal, by reason of his apparent likelihood to step into St. Peter\u0027s chair, that in two \u0027\u0027conclaves\u0027\u0027 he went in pope and came out again cardinal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A private meeting; a close or secret assembly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The verdicts pronounced by this \u0027\u0027conclave\u0027\u0027 (Johnson\u0027s Club) on new books, were speedily known over all London\", \"priority\":5}]}, \"synonyms\":{}}");

	add("conclusion", "{\"term\":\"conclusion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|conclusion}}, from Latin \u0027conclusio\u0027 from the past participle stem of \u0027concludere\u0027 (to conclude)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The end, finish, close or last part of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Prescot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A flourish of trumpets announced the \u0027\u0027conclusion\u0027\u0027 of the contest\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The outcome or result of a process or act\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A decision reached after careful thought\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And the \u0027\u0027conclusion\u0027\u0027 is, she shall be thine\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The board has come to the \u0027\u0027conclusion\u0027\u0027 that the proposed takeover would not be in the interest of our shareholders\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With fresh material, taxonomic \u0027\u0027conclusions\u0027\u0027 are leavened by recognition that the material examined reflects the site it occupied; a herbarium packet gives one only a small fraction of the data desirable for sound \u0027\u0027conclusions\u0027\u0027. Herbarium material does not, indeed, allow one to extrapolate safely: what you see is what you get\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In an argument or syllogism, the proposition that follows as a necessary consequence of the premises\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"He granted him both the major and minor, but denied him the \u0027\u0027conclusion\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"An experiment, or something from which a conclusion may be drawn\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"We practice likewise all \u0027\u0027conclusions\u0027\u0027 of grafting and inoculating\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The end or close of a pleading, e.g. the formal ending of an indictment, \u0026quot;against the peace\u0026quot;, etc\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An estoppel or bar by which a person is held to a particular position\", \"priority\":17}]}, \"synonyms\":{}}");

	add("concoction", "{\"term\":\"concoction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|concoctiōnem}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Digestion (of food etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"New York Review of Books, 2001, p.260\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sorrow] hinders \u0027\u0027concoction\u0027\u0027, refrigerates the heart, takes away stomach, colour, and sleep; thickens the blood\u0026amp;nbsp;[…\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The preparing of a medicine, food or other substance out of many ingredients\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mixture prepared in such a way\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Something made-up, an invention\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of digesting in the mind; rumination\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Abatement of a morbid process, such as fever, and return to a normal condition\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The act of perfecting or maturing\", \"priority\":9}]}, \"synonyms\":{}}");

	add("concordance", "{\"term\":\"concordance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French from \u0027concordantia\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"agreement; accordance; consonanc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:Thomas Thomas Carlyl\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Contrasts, and yet \u0027\u0027concordances\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"concord; agreement\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An alphabetical verbal index showing the places in the text of a book where each principal word may be found, with its immediate context in each place\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"c. \u0027\u00271857\u0027\u0027, \u0026quot;Paul Bunyan\u0026quot;, contribution to the \u0027Encyclopaedia Britannica\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"His knowledge of the Bible was such, that he might have been called a living concordance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a list of occurrences of a word or phrase from a corpus, with the immediate context\", \"priority\":8}]}, \"synonyms\":{}}");

	add("concordat", "{\"term\":\"concordat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027concordat\u0027 from Latin \u0027concordatum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formal agreement between two parties, especially between a church and a state; specifically, an agreement between the Pope and a government\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1820\u0027\u0027, Theodore Lyman, \u0027The Political State of Italy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That eminent and independant statesman, Count Louis of Medicis, concluded a \u0027\u0027concordat\u0027\u0027 with cardinal Gonsalvi, at Terracina, on the 16th February, 1816, probably the most humiliating instrument to which the Roman court has been forced to submit since the fall of the Bonapartes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, William Scott, \u0027The Christian Remembrancer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Concordat\u0027\u0027 of the See of Rome with King Diniz is the most interesting ecclesiastical epoch […\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Bruno Kreisky, Matthew Paul Berg, \u0027The Struggle for a Democratic Austria: Bruno Kreisky on Peace and Social Justice\u0027, page 48\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Later, he also promoted a significant degree of reconciliation between the Austrian social democratic movement and the Roman Catholic Church through the negotiation of the 1960 \u0027\u0027Concordat\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Hilary Mantel, \u0027Wolf Hall\u0027, Fourth Estate 2010, p. 116\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1527: when the cardinal comes back from France, he immediately begins ordering up banquets. French ambassadors are expected, to set the seal on his \u0027\u0027concordat\", \"priority\":9}]}, \"synonyms\":{}}");

	add("concrescentism", "{\"term\":\"concrescentism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a contemporary movement in art and design that extracts representational elements, motifs or devices that are characteristic of one or more art movements, or cultures and then subjects them to the characteristic traits or processes from an entirely different range of art movements or cultures in an effort to evolve hybrids or cross-combinations that are entirely new forms of artistic expression\", \"priority\":1}]}, \"synonyms\":{}}");

	add("concreteness", "{\"term\":\"concreteness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concrete|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being concret\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the result of being concrete\", \"priority\":2}]}, \"synonyms\":{}}");

	add("concretion", "{\"term\":\"concretion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027concrétion\u0027 from Latin \u0027concretio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of aggregating or coalescing into a mass\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A solid, hard mass formed by a process of aggregation or coalescence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A rounded mass of a mineral, sometimes found in sedimentary rock or on the ocean floor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1844\u0027\u0027, w:Charles Charles Darwin, \u0027Geological Observations on South America\u0027, ch. 5\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Of the three beds, the central one is the most compact, and more like ordinary sandstone: it includes numerous flattened spherical \u0027\u0027concretions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The action of making something concrete or the result of such an action\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1860\u0027\u0027, w:Nathaniel Nathaniel Hawthorne, \u0027The Marble Faun\u0027, ch. 14\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;My new statue!\u0026quot; said Kenyon. . . . \u0026quot;It is the \u0027\u0027concretion\u0027\u0027 of a good deal of thought, emotion, and toil of brain and hand.\u0026quot\", \"priority\":8}]}, \"synonyms\":{}}");

	add("concretism", "{\"term\":\"concretism\", \"etymology\":{\"influencers\":[], \"languages\":[\"Italian\"], \"text\":\"\u0026lt;!-- \u0027concretismo\u0027 --\u0026gt;{{suffix|concrete|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abstractionist painting movement that evolved in the 1930s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"reification; the fallacy of treating an abstraction like a real entity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("concretum", "{\"term\":\"concretum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concrete|um|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that is concrete, rather than abstract\", \"priority\":1}]}, \"synonyms\":{}}");

	add("concubinage", "{\"term\":\"concubinage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|concubinage|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of cohabiting or living together as man and wife while not married\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being a concubine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027 Websters International Dictionary. \u0026quot;In some countries, \u0027\u0027concubinage\u0027\u0027 is marriage of an inferior kind, or performed with less solemnity than a true or formal marriage; or marriage with a woman of inferior condition to whom the husband does not convey his rank or quality. Under Roman Law, it was the living together of a man and a woman in sexual relations without marriage but in conformity with local law.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("concubinary", "{\"term\":\"concubinary\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|concubine|ary|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a concubine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("concubine", "{\"term\":\"concubine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\", \"anglo-norman\"], \"text\":\"Origin: 1250–1300; Middle english (1100-1500) from Anglo-norman from Latin {{m|la|concubīna}}, equivalent to \u0027\u0027 () (variant stem of {{m|la|concumbō||to lie together}}) + feminine suffix {{m|la|-īna}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sexual partner, especially a woman, to whom one is not or cannot be married\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A woman who lives with a man, but who is not a wife\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A slave-girl or woman, kept for instance in a harem, who is held for sexual service\", \"priority\":3}]}, \"synonyms\":{}}");

	add("concupiscence", "{\"term\":\"concupiscence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|concupiscentia}}, from {{m|la|concupīscō||I desire strongly, I desire eagerly; I covet}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ardent desire, especially sexual desire; lust\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Quite certainly you command me to refrain from \u0027\u0027concupiscence\u0027\u0027 of the flesh and \u0027\u0027concupiscence\u0027\u0027 of the eyes and worldy pride.\u0027 \u0026amp;mdash; St. Augustine, \u0027The Confessions\u0027 X, 30, 41. Trans Maria Boulding\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, w:Henry Henry James, \u0027The Aspern Papers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Poor Miss Tita\u0027s sense of her failure had produced an extraordinary alteration in her, but I had been too full of my literary \u0027\u0027concupiscence\u0027\u0027 to think of that. Now I perceived it; I can scarcely tell how it startled me\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He was torn by two intense and conflicting desires: his ardent wish to advance through his association with Mr. Browning, and his \u0027\u0027concupiscence\u0027\u0027.\u0027 \u0026amp;mdash; \u0027Please Pass the Guilt\u0027, Rex Stout, 1973\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Skaters, spinning like atoms across fields of pure light, are desirable in a way that transcends mere \u0027\u0027concupiscence\u0027\u0027; they inhabit another element, and the man who would try to catch one risks, literally, falling on his ass.\u0027 \u0026amp;mdash; \u0027Newsweek\u0027, Winter 1994\", \"priority\":6}]}, \"synonyms\":{}}");

	add("concupy", "{\"term\":\"concupy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"concupiscenc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("condemnation", "{\"term\":\"condemnation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027condemnatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of condemning or pronouncing to be wrong; censure; blame; disapprobation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of judicially condemning, or adjudging guilty, unfit for use, or forfeited; the act of dooming to punishment or forfeiture\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being condemned\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The ground or reason of condemning\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The process by which a public entity exercises its powers of eminent domain\", \"priority\":5}]}, \"synonyms\":{}}");

	add("condensation", "{\"term\":\"condensation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|condenser|ation|lang\u003dfr}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of condensing or of being condense\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being condensed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The conversion of a gas to a liquid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The condensate so formed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The reaction of two substances with the simultaneous loss of water or other small molecule\", \"priority\":5}]}, \"synonyms\":{}}");

	add("condensin", "{\"term\":\"condensin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|condense|in|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large protein complexes that plays a central role in chromosome assembly and segregation in eukaryotic cells\", \"priority\":1}]}, \"synonyms\":{}}");

	add("condescension", "{\"term\":\"condescension\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027condescensio\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of condescending; a manner of behaving toward others in an outwardly polite way that nevertheless implies one’s own superiority to the others; patronizing courtesy toward inferiors\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003d\u0026quot;Unfortunate situation, \u0026quot; she replied, making an effort to moderate her superciliousness to mere \u0027\u0027condescension\u0027\u0027.\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL1521052W|passage\u003dMother very rightly resented the slightest hint of \u0027\u0027condescension\u0027\u0027. She considered that the exclusiveness of Peter\u0027s circle was due not to its distinction, but to the fact that it was an inner Babylon of prodigality and whoredom\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dHow can I tell them that they must never expect too much from a middle-aged fellow in striped cotton pajamas? But tonight is different. There is a whole concourse of Romans and of tourists in the Piazza, and it would be a courtesy -- excuse me, Holiness, a great \u0027\u0027condescension\u0027\u0027! -- to appear with one small blessing.... I condescend, and I am exalted once again on wave after wave of cheering and horn-blowing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A patronizing attitude or behavior\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dHe\u0027s a snob of the first water and views the lower orders with infinite \u0027\u0027condescension\", \"priority\":6}]}, \"synonyms\":{}}");

	add("condiment", "{\"term\":\"condiment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027condiment\u0027 from Latin \u0027condimentum\u0027 from \u0027condire\u0027 (to preserve, pickle, season) See \u0027condite\u0027 and compare \u0027recondite\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something used to enhance the flavor of food; for example, salt or pepper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d21 July passage\u003dCongressmen gleefully wolfed down every imaginable version of the hot dog\u0026amp;nbsp;– smoked kielbasas, jumbo grillers, Big \u0026amp; Juicy\u0027s, kosher dogs and spiced dogs\u0026amp;nbsp;– topped with every imaginable \u0027\u0027condiment\u0027\u0027\u0026amp;nbsp;– hot mustard, sweet mustard, jalapenos, spaghetti sauce, regular relish, corn relish, maple syrup salsa and the secret sauce of Rep. (R-Ga.). (\u0026quot;If I told you the recipe,\u0026quot; an aide explained, \u0026quot;I\u0027d have to shoot you.\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("condition", "{\"term\":\"condition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027condicion\u0027 (French \u0027condition\u0027 , from Latin {{m|la|conditiō}}, noun of action from perfect passive participle \u0027conditus\u0027 + noun of action suffix \u0027-io\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A logical clause or phrase that a conditional statement uses. The phrase can either be true or false\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A requirement, term or requisite\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A clause in a contract or agreement indicating that a certain contingency may modify the principal obligation in some way\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The health status of a medical patient\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The state or quality\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dMr. Cooke at once began a tirade against the residents of Asquith for permitting a sandy and generally disgraceful \u0027\u0027condition\u0027\u0027 of the roads. So roundly did he vituperate the inn management in particular, and with such a loud flow of words, that I trembled lest he should be heard on the veranda\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A particular state of being\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The situation of a person or persons, particularly their social and/or economic class, rank\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A man of his \u0027\u0027condition\u0027\u0027 has no place to make request\", \"priority\":9}]}, \"synonyms\":{}}");

	add("conditionalism", "{\"term\":\"conditionalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine that salvation after death is conditional\", \"priority\":1}]}, \"synonyms\":{}}");

	add("condolence", "{\"term\":\"condolence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027condoleo\u0027 (lang\u003dla) from Latin \u0027con-\u0027 (lang\u003dla) + \u0027doleo\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"comfort, support or sympath\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There was not much to do after the accident but offer what \u0027\u0027condolence\u0027\u0027 I could\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An expression of comfort, support, or sympathy offered to the family and friends of somebody who has die\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I sent her a card expressing my \u0027\u0027condolences\u0027\u0027 after her mother passed away\", \"priority\":4}]}, \"synonyms\":{}}");

	add("condolences", "{\"term\":\"condolences\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027condoleo\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"comfort, support, or sympathy offered to the family and friends of somebody who has die\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I sent her a card expressing my \u0027\u0027condolences\u0027\u0027 after her mother passed away\", \"priority\":2}]}, \"synonyms\":{}}");

	add("condom", "{\"term\":\"condom\", \"etymology\":{\"influencers\":[], \"languages\":[\"Italian\"], \"text\":\"{{unk.|en}}. Many theories exist. See Italian \u0027guantone\u0027 from \u0027guanto\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flexible sleeve made of latex or other impermeable material such as sheepskin, worn over an erect penis during intercourse as a contraceptive or as a way to prevent the spread of STDs\", \"priority\":1}]}, \"synonyms\":{\"list\":[{\"text\":\"johnny\", \"synonymQualifier\":\"SLANG\"},{\"text\":\"rubber\", \"synonymQualifier\":\"SLANG\"},{\"text\":\"raincoat\", \"synonymQualifier\":\"SLANG\"},{\"text\":\"protection\", \"synonymQualifier\":\"EUPHEMISM\"},{\"text\":\"jimmy hat\", \"synonymQualifier\":\"SLANG\"}]}}");

	add("condominium", "{\"term\":\"condominium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027condominium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Joint sovereignty over a territory by two or more countries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Anglo-Egyptian Sudan was a \u0027\u0027condominium\u0027\u0027 ruled jointly by Egypt and the United Kingdom of Great Britain and Ireland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A region or territory under such rule\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Clive H Church \u0026amp; Randolph C Head, \u0027A Concise History of Switzerland\u0027, Cambridge 2013, p. 76\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The strategic location of the \u0027\u0027condominiums\u0027\u0027 […]made them important for the Confederacy\u0027s territorial integrity even if they produced little revenue\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A building in which each unit is owned by an individual but the grounds, structure etc is owned jointly\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the system of ownership by which such condominiums operat\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A unit or apartment in such a complex\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The legal tenure involved\", \"priority\":9}]}, \"synonyms\":{}}");

	add("conduct", "{\"term\":\"conduct\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027conductus\u0027 (lang\u003dla) from Latin \u0027conductus\u0027 perfect passive participle of {{m|la|condūcō||bring together}}; see also \u0027\u0027 and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or method of controlling or directin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1785\u0027\u0027, \u0027The Principles of Moral and Political Philosophy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There are other restrictions imposed upon the \u0027\u0027conduct\u0027\u0027 of war, not by the law of nature primarily, but by the laws of war first, and by the law of nature as seconding and ratifying the laws of war\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ld. Brougha\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027conduct\u0027\u0027 of the state, the administration of its affair\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Skillful guidance or management; generalship\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Conduct\u0027\u0027 of armies is a prince\u0027s art\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"attacked the Spaniards with great impetuosity, but with so little \u0027\u0027conduct\u0027\u0027, that his forces were totally routed\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The manner of guiding or carrying oneself; personal deportment; mode of action; behavior\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Good \u0027\u0027conduct\u0027\u0027 will be rewarded and likewise poor \u0027\u0027conduct\u0027\u0027 will be punished\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"All these difficulties were increased by the \u0027\u0027conduct\u0027\u0027 of Shrewsbury\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"What in the \u0027\u0027conduct\u0027\u0027 of our life appears / So well designed, so luckily begun, / But when we have our wish, we wish undone\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Plot; action; construction; manner of development\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"the book of Job, in \u0027\u0027conduct\u0027\u0027 and dictio\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Convoy; escort; guard; guide\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"I will be your \u0027\u0027conduct\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"In my \u0027\u0027conduct\u0027\u0027 shall your ladies come\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"That which carries or conveys anything; a channel; a conduit; an instrument\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"although thou hast been \u0027\u0027conduct\u0027\u0027 of my chame\", \"priority\":19}]}, \"synonyms\":{}}");

	add("conductance", "{\"term\":\"conductance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A measure of the ability of a body to conduct electricity; the reciprocal of its resistance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conductivity", "{\"term\":\"conductivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conductive|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability of a material to conduct electricity, heat, fluid or soun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The reciprocal of resistivity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("conductometry", "{\"term\":\"conductometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Measurement of the electrical conductivity of a solution during the course of a chemical reaction. It is the determination of the quantity of a material present in a mixture by measurement of its effect on the electrical conductivity of the mixture\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conductor", "{\"term\":\"conductor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027conductour\u0027 from Old french (842-ca. 1400) \u0027conduitor\u0027 from Latin \u0027conductor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who conducts or leads; a guide; a director\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Zeal, the blind \u0027\u0027conductor\u0027\u0027 of the will\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who conducts an orchestra, choir or other music ensemble; a professional whose occupation is conducting\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who takes tickets on public transportation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"train \u0027\u0027conductor\u0027\u0027; tram \u0027\u0027conductor\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something that can transmit electricity, heat, light or sound\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ideal of a ring that measures how far it is from being integrally close\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, F van Oystaeyen, Lieven Le Bruyn, \u0027Perspectives in ring theory\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"If c is the \u0027\u0027conductor\u0027\u0027 ideal for R in R then prime ideals not containing c correspond to localizations yielding discrete valuation rings\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A grooved sound or staff used for directing instruments, such as lithontriptic forceps; a director\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A leader\", \"priority\":12}]}, \"synonyms\":{}}");

	add("conductress", "{\"term\":\"conductress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conductor|ess|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a female conductor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("condurango", "{\"term\":\"condurango\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bark of a South American vine, of the milkweed family, once erroneously believed to cure cancer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("condyle", "{\"term\":\"condyle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027condyle\u0027 from Latin \u0027condylus\u0027 from Ancient greek (to 1453) \u0027κόνδυλος\u0027 (knuckle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A smooth prominence on a bone where it forms a joint with another bone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1927\u0027\u0027: “It\u0027s the upper \u0027\u0027condyle\u0027\u0027 of a human femur,” said I. — Arthur Conan Doyle, ‘The Adventure of Shoscombe Old Place’ (Norton 2005 p. 1717\", \"priority\":2}]}, \"synonyms\":{}}");

