	add("confabulation", "{\"term\":\"confabulation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Latin \u0027confabulari\u0027 \u0026quot;to talk together\u0026quot;, \u0027com-\u0027 \u0026quot;together\u0026quot; + \u0027fabulari\u0027 \u0026quot;to chat\u0026quot; from \u0027fabula\u0027 \u0026quot;fable, tale\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A casual conversation; a chat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fabricated memory believed to be true\", \"priority\":2}]}, \"synonyms\":{}}");

