	add("confan", "{\"term\":\"confan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|con|fan|gloss1\u003dconvention|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A science fiction fan primarily interested in conventions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Wake up fandom, not everyone here is large. If the equal rights of the slim are not recognized we could find ourselves in a mud-slinging contest that will make the zinefan vs. \u0027\u0027confan\u0027\u0027 fight look like a sand-box squabble\", \"priority\":2}]}, \"synonyms\":{}}");

	add("confection", "{\"term\":\"confection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027confescioun\u0027 from Old french (842-ca. 1400) \u0027confeccion\u0027 (French \u0027confection\u0027 , from Latin \u0027confectionem\u0027 (nominative \u0027\u0027 , from \u0027confectus\u0027, past participle of \u0027conficere\u0027 () from \u0027com-\u0027 (with) + \u0027facere\u0027 (to make, do) Originally \u0026quot;the making by means of ingredients\u0026quot;; sense of \u0026quot;candy or light pastry\u0026quot; predominant since 1500\u0027s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A food item prepared very sweet, frequently decorated in fine detail, and often preserved with sugar, such as a candy, sweetmeat, fruit preserve, pastry, or cake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The table was covered with all sorts of tempting \u0027\u0027confections\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act or process of confecting; the process of making, compounding, or preparing something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The result of such a process; something made up or confected; a concoction\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The defense attorney maintained that the charges were a \u0027\u0027confection\u0027\u0027 of the local police\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An artistic, musical, or literary work taken as frivolous, amusing, or contrived; a composition of a light nature\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something, such as a garment or a decoration, seen as very elaborate, delicate, or luxurious, usually also seen as impractical or non-utilitarian\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, w:Susan Susan Sizemore, \u0027Primal Desires\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She found a sexy, lacy \u0027\u0027confection\u0027\u0027 in a lingerie drawer and quickly slipped into it\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A preparation of medicine sweetened with sugar, honey, syrup, or the like; an electuary\", \"priority\":10}]}, \"synonyms\":{}}");

	add("confederate", "{\"term\":\"confederate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a member of a confederac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an accomplice in a plo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He found some of his \u0027\u0027confederates\u0027\u0027 in gaol\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An actor who participates in a psychological experiment pretending to be a subject but in actuality working for the researcher (also known as a \u0026quot;stooge\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("confederation", "{\"term\":\"confederation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle french (ca. 1400-1600) \u0027confédération\u0027 from Old french (842-ca. 1400) \u0027confederacion\u0027 from Latin \u0027confoederatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A union or alliance of states or political organizations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of forming an alliance\", \"priority\":2}]}, \"synonyms\":{}}");

	add("conference", "{\"term\":\"conference\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027conférence\u0027 from \u0027conferentia\u0027 from Latin \u0027conferens\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of consulting together formally; serious conversation or discussion; interchange of views\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nor with such free and friendly \u0027\u0027conference\u0027\u0027 / As he hath used of old\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A multilateral diplomatic negotiation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A formalized event where scientists present their research results in speeches, workshops, posters or by other means\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An event organized by a for-profit or non-profit organization to discuss a pressing issue, such as a new product, market trend or government regulation, with a range of speakers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A group of sports teams that play each other on a regular basis\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The act of comparing two or more things together; comparison\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Hooke\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"helps and furtherances which the mutual \u0027\u0027conference\u0027\u0027 of all men\u0027s collections and observations may affor\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A stated meeting of preachers and others, invested with authority to take cognizance of ecclesiastical matters\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A voluntary association of Congregational churches of a district; the district in which such churches are\", \"priority\":12}]}, \"synonyms\":{}}");

	add("conferencegoer", "{\"term\":\"conferencegoer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conference|goer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is attending a conferenc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Our restaurant offers discounts to \u0027\u0027conferencegoers\", \"priority\":2}]}, \"synonyms\":{}}");

	add("confession", "{\"term\":\"confession\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from Latin {{m|la|cōnfessiō||confession, acknowledgment, creed or avowal of one\u0027s faith}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The open admittance of having done something (especially of something bad\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Without the real murderer\u0027s \u0027\u0027confession\u0027\u0027, an innocent person will go to jail\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"With a crafty madness keeps aloof, / When we would bring him on to some \u0027\u0027confession\u0027\u0027 / Of his true state\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A formal document providing such an admission\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He forced me to sign a \u0027\u0027confession\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The disclosure of one\u0027s sins to a priest for absolution. Now termed the sacrament of reconciliation\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I went to \u0027\u0027confession\u0027\u0027 and now I feel much better about what I had done\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"First Folio ed\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Hauing diſpleaſ\u0027d my Father, to \u0027Lawrence\u0027 Cell, / To make \u0027\u0027confeſſion\u0027\u0027, and to be abſolu\u0027d\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Acknowledgment of belief; profession of one\u0027s faith\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Bible, Rom. x. 1\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"With the mouth \u0027\u0027confession\u0027\u0027 is made unto salvation\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A formula in which the articles of faith are comprised; a creed to be assented to or signed, as a preliminary to admission to membership of a church; a confession of faith\", \"priority\":14}]}, \"synonyms\":{}}");

	add("confessor", "{\"term\":\"confessor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027confessour\u0027 and its source, Latin \u0027confessor\u0027 from {{m|la|cōnfitērī}}, present active infinitive of {{m|la|cōnfiteor||confess, admit, acknowledge}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who confesses faith in Christianity in the face of persecution, but who is not martyred\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 174\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Confessors\u0027\u0027 provided the troubled Church with an alternative sort of authority based on their sufferings, particularly when arguments began about how and how much to forgive those Christians who had given way to imperial orders – the so-called ‘lapsed’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who confesses to having done something wrong\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A priest who hears confession and then gives absolution\", \"priority\":5}]}, \"synonyms\":{}}");

	add("confetti", "{\"term\":\"confetti\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|it|confetti|lang\u003den}}, plural of \u0027confetto\u0027 (confection)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Small pieces or strips (streamers) of colored paper generally thrown about at festive occasions, especially at weddings\", \"priority\":1}]}, \"synonyms\":{}}");

	add("confidant", "{\"term\":\"confidant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027confident\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person in whom one can confide or share one\u0027s secrets: a frien\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You love me for no other end / Than to become my \u0027\u0027confidant\u0027\u0027 and friend; / As such I keep no secret from your sight.\u0027 \u0026amp;mdash; Dryden\", \"priority\":2}]}, \"synonyms\":{}}");

	add("confidence", "{\"term\":\"confidence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027confidence\u0027 from Latin \u0027confidentia\u0027 \u0026amp;gt; \u0027confidere\u0027 \u0026amp;gt; \u0027con-\u0027 + \u0027fidere\u0027 \u0026amp;gt; \u0027fides. ( probability) Likelihood something is reliable.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Passive self-assurance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Expression or feeling of certainty\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The quality of trusting\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Information held in secret\", \"priority\":4}]}, \"synonyms\":{}}");

	add("confidentiality", "{\"term\":\"confidentiality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being confidential\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something told in confidence; a secret\", \"priority\":2}]}, \"synonyms\":{}}");

	add("confider", "{\"term\":\"confider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|confide|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who confides\", \"priority\":1}]}, \"synonyms\":{}}");

	add("configuration", "{\"term\":\"configuration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027configuration\u0027 from Latin \u0027configuratio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Form, as depending on the relative disposition of the parts of a thing\u0027s shape; figure; form factor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Relative position or aspect of the planets; the face of the horoscope, according to the relative positions of the planets at any time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The way things are arranged or put together in order to achieve a result\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The arrangement of electrons in an atom, molecule, or other physical structure like a crystal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A finite set of points and lines (and sometimes planes), generally with equal numbers of points per line and equal numbers of lines per point\", \"priority\":5}]}, \"synonyms\":{}}");

	add("confinedness", "{\"term\":\"confinedness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|confined|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being confined; lack of space\", \"priority\":1}]}, \"synonyms\":{}}");

	add("confirmation", "{\"term\":\"confirmation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027confirmacion\u0027 from Latin \u0027confirmatio\u0027 noun of process from \u0027confirmatus\u0027 (lang\u003dla) perfect passive participle of \u0027confirmo\u0027 from \u0027con-\u0027 (lang\u003dla) + \u0027firmo\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An official indicator that things will happen as planne\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Verification that something has happene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sacrament of sealing and strengthening in many Christian Churches, often including a ceremony of anointing\u0026lt;!-- a sacrament IS a ceremony--no need for two definitions --\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"composer \u003d album \u003d w:The Stranger The passage \u003d You got a nice white dress / and a party on your \u0027\u0027confirmation\u0027\u0027. / You\u0027ve got a brand new soul, / mm, and a cross of gold\", \"priority\":4}]}, \"synonyms\":{}}");

	add("confiscation", "{\"term\":\"confiscation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027confiscation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of confiscating\", \"priority\":1}]}, \"synonyms\":{}}");

	add("confix", "{\"term\":\"confix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{etystub|en|seems actually from Latin configo}}{{confix|con|fix|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An affix consisting of a prefix and suffix affixed simultaneously to the roo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An affix which is not divided, and which does not divide a root: thus, a prefix, suffix, or interfi\", \"priority\":2}]}, \"synonyms\":{}}");

	add("conflagration", "{\"term\":\"conflagration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) from Latin {{m|la|cōnflagrātiō||burning, conflagration}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large fire extending to many objects, or over a large space; a general burning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It took sixty firefighters to put out the \u0027\u0027conflagration\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large-scale conflict\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:Boris Boris Sidis, \u0027s:The Source and Aim of Human The Source and Aim of Human Progress\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This was well brought out in the skillfully conducted campaigns by the various governments in appealing to the masses with their characteristic suggestible subconsciousness, stirring to the very depths the reflex consciousness of gregarious man by all sorts of direct and indirect suggestions of fear of attacks and patriotic reactions of self-defence against such attacks until the evil genie of self-preservation and fear became loose, resulting in a sweeping \u0027\u0027conflagration\u0027\u0027 of a war of nations with all the horror of diseases, mutilation, and extermination of millions of human lives, over seventeen and a half millions, according to latest accounts, having perished in this world-massacre of the human race\", \"priority\":5}]}, \"synonyms\":{}}");

	add("conflict", "{\"term\":\"conflict\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027conflictus\u0027 past participle of \u0027confligere\u0027 (to strike together) from \u0027com-\u0027 (together) (a form of con-) + \u0027fligere\u0027 (to strike)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N1\u0026quot;\u0026gt;A clash or disagreement,\u0026lt;/span\u0026gt; often violent, between two opposing groups or individuals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/global-development/2013/jul/12/war-denying-children-education Denied an education by passage\u003dOne particularly damaging, but often ignored, effect of \u0027\u0027conflict\u0027\u0027 on education is the proliferation of attacks on schoolsas children, teachers or school buildings become the targets of attacks. Parents fear sending their children to school. Girls are particularly vulnerable to sexual violence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N2\u0026quot;\u0026gt;An incompatibility, as of two things that cannot be simultaneously fulfilled.\u0026lt;/span\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("confluence", "{\"term\":\"confluence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{loanword|LL.|confluentia|lang\u003den}}, from \u0027lang\u003dla\u0027 + \u0027lang\u003dla\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The place where two rivers, streams, or other continuously flowing bodies of water meet and become one, especially where a tributary joins a river\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We encountered an abandoned boat at the \u0027\u0027confluence\u0027\u0027 of the Mississippi and Ohio Rivers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of combining which occurs at the place where rivers and the lake meet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027confluence\u0027\u0027 of the rivers produced a great rush of water\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A convergence or combination of forces, people, or things\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027confluence\u0027\u0027 of our skills resulted in a successful home renovation project\", \"priority\":6}]}, \"synonyms\":{}}");

	add("conformist", "{\"term\":\"conformist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conform|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"someone who tries to conform to the mainstream\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conformity", "{\"term\":\"conformity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027conformité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"State of things being similar or identical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A point of resemblance; a similarity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"State of being conforming, of complying with a set of rules, with a norm or standard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The ideology of adhering to one standard or social uniformity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"How far should one accept the rules of the society in which one lives? To put it another way: at what point does \u0027\u0027conformity\u0027\u0027 become corruption? Only by answering such questions does the conscience truly define itself.\u0027 - q:Kenneth Kenneth Tynan\", \"priority\":5}]}, \"synonyms\":{}}");

	add("confrontation", "{\"term\":\"confrontation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of confronting or challenging another, especially face-to-fac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A conflict between armed forces\", \"priority\":2}]}, \"synonyms\":{}}");

	add("confrontationism", "{\"term\":\"confrontationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|confrontation|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A policy of confrontation\", \"priority\":1}]}, \"synonyms\":{}}");

