	add("confucianism", "{\"term\":\"confucianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The philosophy and teaching of Confucius\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The school of thought and philosophy centered on Confucian principles, originating in China, including later teachings of scholars such as :w:Zhu Zhu Xi (Chu Hsi\", \"priority\":2}]}, \"synonyms\":{}}");

	add("confucius", "{\"term\":\"confucius\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Latin\"], \"text\":\"From Latin {{m|la|Confucius}}, from Mandarin chinese {{zh-l|孔夫子|Kǒng Fūzǐ|Master Kong}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Western name of Kong Qiu (孔丘), an influential Chinese philosopher who lived 551 – 479\", \"priority\":1}]}, \"synonyms\":{}}");

	add("confusion", "{\"term\":\"confusion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027confusion\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lack of clarity or order\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being confused; misunderstanding\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"disgrace, shame\", \"priority\":3}]}, \"synonyms\":{}}");

