	add("conga", "{\"term\":\"conga\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a tall, narrow, single-headed Cuban hand drum of African origi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a march of Cuban origin in four-four time in which people form a chain, each holding the hips of the person in front of them; in each bar, dancers take three shuffle steps and then kick alternate legs outwards at the beat; the chain weaves around the place and allows new participants to join the back of the chain\", \"priority\":2}]}, \"synonyms\":{}}");

