	add("congelifraction", "{\"term\":\"congelifraction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Kirk Bryan (geologist)|Kirk Bryan in 1946 in \u0026quot;Cryopedology—the study of frozen ground and intensive frost action with suggestions on nomenclature\u0026quot; in the \u0027American Journal of Science\u0027, volume 244, pages 622–642.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the weathering of material through the repeated freezing and thawing of water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, Arthur T. Fernald, \u0026quot;Geomorphology of the Upper Kuskokwim region, Alaska\u0026quot;, U.S. Geological Survey, \u0027Geological Survey Bulletin\u0027, issue 1071, page [http://books.google.co.uk/books?id\u003dbmoeAQAAIAAJ\u0026amp;pg\u003dPA215 215\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The rubble is produced by intense frost riving, or \u0027\u0027congelifraction\u0027\u0027\u0026lt;!-- bold instead of quotes --\u0026gt; (Bryan, 1946, p. 640), of the bedrock\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, QA International, \u0027Understanding the Earth\u0027, ISBN 978-2764408902, page [http://books.google.co.uk/books?id\u003dYxhp1LqpE2gC\u0026amp;pg\u003dPA73 73\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Congelifraction\u0027\u0027 occurs in mountains where frosts and thaws alternate\", \"priority\":5}]}, \"synonyms\":{}}");

	add("congener", "{\"term\":\"congener\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027congénère\u0027 from Latin {{compound|com-|genus|t1\u003dsame|t2\u003dkind|lang\u003dla|nocat\u003d1}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant or animal of the same taxonomic genus as another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person or thing similar in behavior or nature to another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of a group of structurally-related compounds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of several alcohols, other than ethanol, that are found in fermented and distilled alcoholic drinks, and are partially responsible for their flavour and character\", \"priority\":4}]}, \"synonyms\":{}}");

	add("congeries", "{\"term\":\"congeries\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|congeriēs||heap, mass, pile}}, from {{m|la|congerō||I carry together}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection or aggregation of disparate items\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, w:William William McKinley, \u0027s:William McKinley\u0027s Second State of the Union Second State of the Union Address\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The world has seen the postal system developed from a \u0027\u0027congeries\u0027\u0027 of independent and exclusive services into a well-ordered union, of which all countries enjoy the manifold benefits\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1928\u0027\u0027, w:Virginia Virginia Woolf, Orlando\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"By short cuts known to him, he made his way now through the vast \u0027\u0027congeries\u0027\u0027 of rooms and staircases to the banqueting-hall, five acres distant on the other side of the house\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, w:H. P. H. P. Lovecraft, \u0027s:Dreams in the Dreams in the Witch-House\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Two of the less irrelevantly moving things - a rather large \u0027\u0027congeries\u0027\u0027 of iridescent, prolately spheroidal bubbles and a very much smaller polyhedron of unknown colours and rapidly shifting surface angles - seemed to take notice of him and follow him about or float ahead as he changed position\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027Monsieur\u0027, Faber \u0026amp; Faber 1992, p. 40\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The three of them could hardly tell themselves apart, became a sort of \u0027\u0027congeries\u0027\u0027 of loving emotions, all mutually complementary\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027Flesh in the Age of Reason\u0027, Penguin 2004, p. 243\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"That whole \u0027\u0027congeries\u0027\u0027 of values was now in question\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027The Sea\u0027, Picador 2005, p. 216\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"It was not what I was that I disliked, I mean the singular, essential me - although I grant that even the notion of an essential, singular self is problematic - but the \u0027\u0027congeries\u0027\u0027 of affects, inclinations, received ideas, class tics, that my birth and upbringing had bestowed on me in place of a personality\", \"priority\":13}]}, \"synonyms\":{}}");

	add("congestee", "{\"term\":\"congestee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|congest|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person living in an area with a very high-density population\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A thing congested to the point of malfunction\", \"priority\":2}]}, \"synonyms\":{}}");

	add("conglomeration", "{\"term\":\"conglomeration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which consists of many previously separate parts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instance of conglomerating, a coming together of separate parts\", \"priority\":2}]}, \"synonyms\":{}}");

	add("congolese", "{\"term\":\"congolese\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French {{m|fr|congolais}}, equivalent to {{suffix|Congo|ese|lang\u003den}}. For information about the \u0027-l-\u0027, see {{m|en|Togolese}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from the Republic of the Cong\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person from the Democratic Republic of the Congo (Zaire\", \"priority\":2}]}, \"synonyms\":{}}");

	add("congratulation", "{\"term\":\"congratulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{prefix|con|gratulation|lang\u003den}}, cognate with Latin \u0027sc\u003dpolytonic|congrātulor\u0027 (i congratulate)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of congratulating\", \"priority\":1}]}, \"synonyms\":{}}");

	add("congregation", "{\"term\":\"congregation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027congregacion\u0027 from Latin {{m|la|congregātiō}}, from congregare \u0026quot;to herd together\u0026quot;, itself from com- \u0026quot;together\u0026quot; + gregare \u0026quot;to collect into a flock, gather\u0026quot; (from grex \u0026quot;a flock, herd\u0026quot;); adopted c.1340 by the English Bible translator William Tyndale, to render the Greek (\u0027ekklesia\u0027) (\u0027those called together, (popular) meeting\u0027; hence Latin ecclesia \u0027church\u0027) in his New Testament, and preferred by 16th century Reformers instead of church.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of congregating or collecting together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A gathering of faithful in a temple, church, synagogue, mosque or other place of worship. It can also refer to the people who are present at a devotional service in the building, particularly in contrast to the pastor, minister, imam, rabbi etc. and/or choir, who may be seated apart from the general congregation or lead the service (notably in responsory form\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Roman Congregation, a main department of the Vatican administration of the universal churc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A corporate body whose members gather for worship, or the members of such a body\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any large gathering of peopl\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The collective noun for eagles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The main body of university staff, comprising academics, administrative staff, heads of colleges, etc\", \"priority\":7}]}, \"synonyms\":{}}");

	add("congregationalism", "{\"term\":\"congregationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system of self-governing Protestant churches\", \"priority\":1}]}, \"synonyms\":{}}");

	add("congregationalism", "{\"term\":\"congregationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several forms of church organization in which each congregation is responsible for its own government\", \"priority\":1}]}, \"synonyms\":{}}");

	add("congregationalist", "{\"term\":\"congregationalist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Congregational|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a Congregational church\", \"priority\":1}]}, \"synonyms\":{}}");

	add("congress", "{\"term\":\"congress\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin congressum, the past participle of congredi \u0027to go or come together\u0027, itself from con- + gradi \u0027to go or step\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coming together of two or more people; a meeting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"New York Review of Books, 2001, p.48\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"After some little repast, he went to see Democritus\u0026amp;nbsp;[…]. The multitude stood gazing round about to see the \u0027\u0027congress\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A formal gathering or assembly; a conference held to discuss or decide on a specific question\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"often capitalized: \u0027\u0027Congress\u0027\u0027)\u0027 A legislative body of a state, originally the bicameral legislature of the United States of America\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An association, especially one consisting of other associations or representatives of interest groups\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The National \u0027\u0027Congress\u0027\u0027 of American Indians\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Coitus; sexual intercourse\", \"priority\":8}]}, \"synonyms\":{}}");

	add("congressman", "{\"term\":\"congressman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|congress|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male member of congress\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A male member of the w:House of House of Representatives\", \"priority\":2}]}, \"synonyms\":{}}");

