	add("conite", "{\"term\":\"conite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027κόνις\u0027 (dust) from its grey colour, {{suffix||ite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A magnesian variety of dolomite\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conjecture", "{\"term\":\"conjecture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from Latin \u0027lang\u003dla|coniectūra\u0027 () from \u0027coniectus\u0027 perfect passive participle of \u0027cōniciō\u0027 (throw or cast together; guess) from \u0027con-\u0027 (together) + \u0027lang\u003dla|iaciō\u0027 () see jet. Compare adjective, eject, inject, project, reject, subject, object, trajectory.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A statement or an idea which is unproven, but is thought to be true; a gues\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"guess\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I explained it, but it is pure \u0027\u0027conjecture\u0027\u0027 whether he understood, or not\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A supposition based upon incomplete evidence; a hypothesis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The physicist used his \u0027\u0027conjecture\u0027\u0027 about subatomic particles to design an experiment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A statement likely to be true based on available evidence, but which has not been formally\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"interpretatio\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Interpretation of signs and omens\", \"priority\":8}]}, \"synonyms\":{}}");

	add("conjecturer", "{\"term\":\"conjecturer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conjecture|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person who conjectures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conjey", "{\"term\":\"conjey\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"rice gruel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;I allow, monks, [...] a constant supply of \u0027\u0027conjey\u0027\u0027\u0026quot; (Vinaya-pitaka 1, 290--94, condensed\", \"priority\":2}]}, \"synonyms\":{}}");

