	add("conjugation", "{\"term\":\"conjugation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|la|coniugātiō|gloss\u003dcombining, connecting; conjugation|lang\u003den}}, from {{m|la|coniugō||join, unite together}}, from \u0027con-\u0027 (with) + {{m|la|iugō||join, bind, connect}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The coming together of things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The temporary fusion of organisms, especially as part of sexual reproductio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sexual relations within marriag\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In some languages, one of several classifications of verbs according to what inflections they take\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of conjugating a verb\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The conjugated forms of a verb\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A system of delocalized orbitals consisting of alternating single bonds and double bond\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A mapping sending \u0027x\u0027 to \u0027gxg\u0026lt;sup\u0026gt;-1\u0026lt;/sup\u0026gt;\u0027, where \u0027g\u0027 and \u0027x\u0027 are elements of a\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A function which negates the non-real part of a or number\", \"priority\":9}]}, \"synonyms\":{}}");

	add("conjunct", "{\"term\":\"conjunct\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027conjunctus\u0027 past participle. See \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either term of a conjunctio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An adjunct that supplements a sentence with information, not considered to be an essential part of the propositional content, that connects the sentence with previous parts of the discourse, as \u0026quot;therefore\u0026quot; in \u0026quot;It was raining. Therefore, we didn\u0027t go swimming.\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("conjunction", "{\"term\":\"conjunction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027conjonction\u0027 from Latin {{m|la|coniūnctiō||joining}}, from \u0027coniungere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of joining, or condition of being joined\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"sexual Sexual intercourse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"vol.1. ch.29\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Certaine Nations (and amongst others, the Mahometane) abhorre \u0027\u0027Conjunction\u0027\u0027 with women great with childe\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A word used to join other words or phrases together into sentences. The specific conjunction used shows how the two joined parts are related. \u0027Example: Bread, butter \u0027\u0027and\u0027\u0027 cheese\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The alignment of two bodies in the solar system such that they have the same longitude when seen from Earth\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An aspect in which planets are in close proximity to one another\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The proposition resulting from the combination of two or more propositions using the ∧ (\u0026lt;math\u0026gt; and\u0026lt;/math\u0026gt;) operator\", \"priority\":8}]}, \"synonyms\":{}}");

	add("conjunctivitis", "{\"term\":\"conjunctivitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|conjunctiva|itis|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inflammation of the conjunctiva, often due to infection\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conjure", "{\"term\":\"conjure\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027conjurer\u0027 () from Latin {{m|la|coniūrō||I swear together; conspire}}, from \u0027con-\u0027 (with, together) + \u0027iūro\u0027 (i swear or take an oath)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A practice of magic; hoodoo; conjuration\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conker", "{\"term\":\"conker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From nineteenth-century dialect \u0027conker\u0027, snail-shell; the game of conkers was originally played using snail-shells.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse chestnut, which is used in the game of conkers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conlang", "{\"term\":\"conlang\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027constructed language\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A constructed language; a language that has been artificially constructed, such as Esperanto, Quenya or Klingo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"url \u003d http://www.dailytexanonline.com/life-and-arts/2012/10/31/ut-language-creation-society-invites-students-to-learn-origins-of-newer passage \u003d You might be familiar with more a priori \u0027\u0027conlangs\u0027\u0027 than you think: The Klingon language from the television series “Star Trek,” the Na’vi language from the movie “Avatar,” and the Dothraki language from the television series “Game of Thrones” are all examples of a priori languages\", \"priority\":2}]}, \"synonyms\":{}}");

	add("conlanger", "{\"term\":\"conlanger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|conlang|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who creates constructed languages (conlangs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Mari C. Jones, Ishtla Singh, \u0027Exploring Language Change\u0027, [http://books.google.com.au/books?id\u003dTbV7rglgk1YC\u0026amp;pg\u003dPA154\u0026amp;dq\u003d%22conlanger%22%7C%22conlangers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlqYQUZnBK4HUkwXhyICABA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22conlanger%22%7C%22conlangers%22\u0026amp;f\u003dfalse page 154\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fact that the Internet has given visible shape to communities of invented language proponents through web sites and chat rooms for enthusiastic \u0027\u0027\u0027conlangers\u0027\u0027\u0027 (‘language constructors’) has probably done little to dispel its reputation as a somewhat unusual and, to all intents and purposes, intangible undertaking\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, William Allison Shimer, \u0027The American Scholar\u0027, Volume 75, [http://books.google.com.au/books?id\u003dUwkEAAAAYAAJ\u0026amp;q\u003d%22conlanger%22%7C%22conlangers%22\u0026amp;dq\u003d%22conlanger%22%7C%22conlangers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlqYQUZnBK4HUkwXhyICABA\u0026amp;redir_esc\u003dy page 99\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The split was between two groups. The first was composed of people interested in quietly developing and discussing the languages they crafted for science-fictional worlds, what-if-a-language-did-this playfulness, or Tolkienesque fun (the true \u0027\u0027conlangers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Bryan Cogman, \u0027Inside HBO′s Game of Thrones\u0027, [http://books.google.com.au/books?id\u003d7FFGD5x6GlIC\u0026amp;pg\u003dPA174\u0026amp;dq\u003d%22conlanger%22%7C%22conlangers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlqYQUZnBK4HUkwXhyICABA\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22conlanger%22%7C%22conlangers%22\u0026amp;f\u003dfalse page 174\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The goal of a \u0027\u0027conlanger\u0027\u0027, a language creator, is to realize a linguistic system that′s both unique and authentic—something that doesn\u0027t exist anywhere on Earth, but which a linguist wouldn′t be surprised to find in the wild\", \"priority\":9}]}, \"synonyms\":{}}");

	add("connacht", "{\"term\":\"connacht\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\", \"old irish (to 900)\"], \"text\":\"From Irish or Old irish (to 900) \u0027connacht\u0027 genitive form of \u0027connachta\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The western province of Ireland, comprising of counties of Galway, Leitrim, Mayo, Roscommon, and Sligo\", \"priority\":1}]}, \"synonyms\":{}}");

	add("connascence", "{\"term\":\"connascence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|con|nascent|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The birth of two or more things at the same time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of growing together\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A relationship between two or more elements of software in which changing one necessitates changing the others in order to maintain overall correctness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That which is born or produced with another\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of growing together\", \"priority\":5}]}, \"synonyms\":{}}");

