	add("connecticut", "{\"term\":\"connecticut\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"Said to be from Mohican ( quinnitukqut \u0026quot;at the long tidal river,\u0026quot; from *kwen- \u0026quot;long\u0026quot; (spelling due to confusion with \u0027connect\u0027) + *-ehtekw \u0026quot;tidal river\u0026quot; + *-enk \u0026quot;place.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Capital: Hartford\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A river in the Northeast region of the United States\", \"priority\":2}]}, \"synonyms\":{}}");

