	add("connectionism", "{\"term\":\"connectionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|connection|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any of several fields of psychology that model brain processes in terms of interconnected networks\", \"priority\":1}]}, \"synonyms\":{}}");

