	add("connectomics", "{\"term\":\"connectomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the connectivity of synapses in the brain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("connector", "{\"term\":\"connector\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|connect|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who connects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Duncan Brown, Nicky Hayes, \u0027Influencer Marketing\u0027 (page 38\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There are only a few genuine social \u0027\u0027connectors\u0027\u0027. True \u0027connectors\u0027\u0026lt;!--sic italics--\u0026gt; collect people like other collectors collect stamps\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A device (or, more precisely, a mating pair of devices, often a plug and a socket) for connecting together two wires, cables, or hoses, allowing electricity or fluid to flow but also allowing easy disconnection and reconnection when necessary\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A highway or freeway road which connects to another highway or freeway. It can be part of an interchange or a longer roadway such as the 1.5 mile (2.5 kilometer) Wikipedia:U.S. Route 24 Connector (Taylor, U.S. Route 24 Connector\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A line connecting two shapes in presentation software\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A software component that provides access from an application program to an external database or data source, such as a JDBC connector\", \"priority\":7}]}, \"synonyms\":{}}");

	add("conniption", "{\"term\":\"conniption\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Since 1833, from {{unk.|en}} origin, perhaps related to \u0027\u0027 or \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fit of anger or panic; conniption fit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When she came downstairs and saw what her children were eating, she had a \u0027\u0027conniption\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"threatened by the \u0027\u0027conniptions\u0027\u0027 gripping Wall Street\u0027 (Businessweek Oct.20, 2008\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fit of laughing; convulsion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The joke was not that funny, but he went into \u0027\u0027conniptions\u0027\u0027 laughing\", \"priority\":5}]}, \"synonyms\":{}}");

	add("connoisseur", "{\"term\":\"connoisseur\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Around 1705–1715, from French \u0027connoisseur\u0027 from the verb \u0027connoître\u0027 (obsolete pre-1835 spelling of \u0027connaître|lang\u003dfr\u0027 () .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specialist of a given field whose opinion is valued; especially in one of the fine arts, or in a matter of tast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, w:Robert Louis Robert Louis Stevenson, \u0027w:Treasure Treasure Island\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This, when it was brought to him, he drank slowly, like a \u0027\u0027connoisseur\u0027\u0027, lingering on the taste\", \"priority\":3}]}, \"synonyms\":{}}");

	add("connotation", "{\"term\":\"connotation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From {{m|la|connotātiō|connotātiō, connotātiōnem}}, from {{m|la|connotō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A meaning of a word or phrase that is suggested or implied, as opposed to a denotation, or literal meaning. A characteristic of words or phrases, or of the contexts that words and phrases are used in\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027connotations\u0027\u0027 of the phrase \u0026quot;you are a dog\u0026quot; are that you are physically unattractive or morally reprehensible, not that you are a canine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A technical term in logic used by J. S. Mill and later logicians to refer to the attribute or aggregate of attributes connoted by a term, and contrasted with \u0027denotation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The two expressions \u0026quot;the morning star\u0026quot; and \u0026quot;the evening star\u0026quot; have different \u0027\u0027connotations\u0027\u0027 but the same denotation (i.e. the planet Venus\", \"priority\":4}]}, \"synonyms\":{}}");

	add("conorfone", "{\"term\":\"conorfone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opioid analgesic, an analogue of hydrocodone substituted with an 8-ethyl group and an N-cyclopropylmethyl group\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conperson", "{\"term\":\"conperson\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|con|gloss1\u003dconstructed|person|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a fictional person, especially one supposed to inhabit a conworld and speak a conlang\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conquest", "{\"term\":\"conquest\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027conqueste\u0027 (Modern French \u0027conquête\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Victory gained through combat; the subjugation of an enemy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act or instance of overcom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"overcoming an obstacle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Prescot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Three years sufficed for the \u0027\u0027conquest\u0027\u0027 of the country\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"That which is conquered; possession gained by force, physical or moral\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Wherefore rejoice? What \u0027\u0027conquest\u0027\u0027 brings he home\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The acquiring of property by other means than by inheritance; acquisition\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A person with whom one has have had sex\", \"priority\":10}]}, \"synonyms\":{}}");

	add("conquistador", "{\"term\":\"conquistador\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027conquistador\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conqueror, but especially one of the Spanish soldiers that invaded Central Central and South America in the 16th century and defeated the Incas and Aztecs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conreport", "{\"term\":\"conreport\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|convention|report|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A report on the events of a convention\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Oh, t\u0027was a lovely con. I promise I\u0027ll finish the \u0027\u0027conreport\u0027\u0027 soonest\", \"priority\":2}]}, \"synonyms\":{}}");

	add("consanguinity", "{\"term\":\"consanguinity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|frm|consanguinité|lang\u003den}}, from Latin \u0027consanguinitas\u0027, from \u0027consanguineosus\u0027 meaning \u0026quot;consanguineous\u0026quot;, from \u0027com-\u0027 meaning \u0026quot;together\u0026quot; + \u0027sanguineus\u0027 meaning \u0026quot;of or pertaining to blood\u0026quot;, from \u0027sanguis\u0027 \u0026quot;blood\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A consanguineous or family relationship through parentage or descent. A blood relationship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1776,\u0027\u0027 \u0027w:United States Declaration of United States Declaration of Independence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They too have been deaf to the voice of justice and of \u0027\u0027consanguinity\", \"priority\":3}]}, \"synonyms\":{}}");

	add("conscience", "{\"term\":\"conscience\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027conscience\u0027 from Latin \u0027conscientia\u0027 (knowledge within oneself) from \u0027consciens\u0027 present participle of \u0027conscire\u0027 () from \u0027com-\u0027 () + \u0027scire\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The moral sense of right and wrong, chiefly as it affects one\u0027s own behaviour\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, w:Albert Albert Einstein, as quoted by Virgil Henshaw in \u0027Albert Einstein: Philosopher Scientist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Never do anything against \u0027\u0027conscience\u0027\u0027, even if the state demands it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, \u0027w:Foundation Foundation\u0027 (1974 w:Panther Panther Books Ltd publication), part V: “The Merchant Princes”, chapter 14, page 175, ¶\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“]Twer is not a friend of mine testifying against me reluctantly and for \u0027\u0027conscience\u0027\u0027’ sake, as the prosecution would have you believe. He is a spy, performing his paid job.[”\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d18|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‘Then the father has a great fight with his terrible \u0027\u0027conscience\u0027\u0027,’ said Munday with granite seriousness. ‘Should he make a row with the police […]? Or should he say nothing about it and condone brutality for fear of appearing in the newspapers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A personification of the moral sense of right and wrong, usually in the form of a person, a being or merely a voice that gives moral lessons and advices\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Consciousness; thinking; awareness, especially self-awareness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1603\u0027\u0027, \u0027\u0027, act 3, scene 1\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Thus \u0027\u0027conscience\u0027\u0027 does make cowards of us all\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"And thus the native hue of resolutio\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Is sicklied o\u0027er with the pale cast of thought\", \"priority\":12}]}, \"synonyms\":{}}");

	add("conscientiousness", "{\"term\":\"conscientiousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being conscientious\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conscientization", "{\"term\":\"conscientization\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Portuguese\"], \"text\":\"Portuguese \u0027conscientização\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A social concept, grounded in Marxist critical theory, that focuses on achieving an in-depth understanding of the world, allowing for the perception and exposure of perceived social and political contradictions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("consciousness", "{\"term\":\"consciousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conscious|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being conscious or aware; awareness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dAlthough the Celebrity was almost impervious to sarcasm, he was now beginning to exhibit visible signs of uneasiness, the \u0027\u0027consciousness\u0027\u0027 dawning upon him that his eccentricity was not receiving the ovation it merited\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21582495-computers-will-help-people-understand-brains-better-and-understanding-brains The machine of a new passage\u003dYet this is the level of organisation that does the actual thinking—and is, presumably, the seat of \u0027\u0027consciousness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("conscript", "{\"term\":\"conscript\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|cōnscriptus}}, perfect passive participle of {{m|la|cōnscrībō||write together; enroll}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is compulsorily enrolled, often into a military service; a draftee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The soldier was a \u0027\u0027conscript\", \"priority\":2}]}, \"synonyms\":{}}");

