	add("consequentialness", "{\"term\":\"consequentialness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the quality or state of being consequential\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conservancy", "{\"term\":\"conservancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conservant|cy|lang\u003den}} or {{suffix|conserve|ancy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The conservation of a resourc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An organization dedicated to the conservation of natural resource\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A commission that deals with fishery and navigatio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A state in which a company is allowed to continue trading without incurring any new financial liabilities or disposing of any asset\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027 April 16, \u0026quot;Midland Insurance was placed in \u0027\u0027conservancy\u0027\u0027.\u0026quot;, w:Los Angeles \u0027Los Angeles Times\u0027\u0026amp;nbsp;[http://articles.latimes.com/1986-04-16/business/fi-268_1_midland-insurance\", \"priority\":5}]}, \"synonyms\":{}}");

	add("conservatard", "{\"term\":\"conservatard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conservative|tard|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conservative\", \"priority\":1}]}, \"synonyms\":{\"list\":[{\"text\":\"rightard\", \"synonymQualifier\":\"DEROGATORY\"},{\"text\":\"wingnut\", \"synonymQualifier\":\"DEROGATORY\"}]}}");

	add("conservation", "{\"term\":\"conservation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of preserving, guarding, or protecting; the keeping (of a thing) in a safe or entire state; preservation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Wise use of natural resources\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You preserve water in times of flood and freshet to be used for power or for irrigation throughout the year. …”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The discipline concerned with protection of biodiversity, the environment, and natural resource\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Genes and associated characteristics of biological organisms that are unchanged by evolution, for example similar or identical nucleic acid sequences or proteins in different species descended from a common ancesto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The protection and care of cultural heritage, including artwork and architecture, as well as historical and archaeological artifact\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"lack of change in a measurable property of an isolated physical system (conservation of energy, mass, momentum, electric charge, subatomic particles, and fundamental symmetries\", \"priority\":7}]}, \"synonyms\":{}}");

	add("conservationism", "{\"term\":\"conservationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A movement that supports conservation, especially that of natural resources\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conservationist", "{\"term\":\"conservationist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conservation|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who maintains natural areas or protects threatened species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who advocates for these actions\", \"priority\":2}]}, \"synonyms\":{}}");

