	add("consideration", "{\"term\":\"consideration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027consideracion\u0027 from Latin \u0027consideratio\u0027 Synchronically analyzable as {{suffix|consider|ation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The thought process of considering, of taking everything into account\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After much \u0027\u0027consideration,\u0027\u0027 I have decided to stay\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something considered as a reason or ground for a (possible) decision\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The tendency to consider others\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You showed remarkable \u0027\u0027consideration\u0027\u0027 in giving up your place for your friend\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Will you noisy children show some \u0027\u0027consideration\u0027\u0027 and stop your infernal screaming? I\u0027m trying to study\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A payment or other recompense for something done\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sure I\u0027ll move my car, but only for a \u0027\u0027consideration\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A matter of inducement for something promised; something valuable given as recompense for a promise, which causes the promise to become binding as a contract\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Importance, claim to notice, regard\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:William Somerset W. Somerset Maugham, \u0027w:The Moon and The Moon and Sixpence\u0027, s:The Moon and Sixpence/Chapter chapter 5\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"settled down on a small property he had near Quimper to live for the rest of his days in peace; but the failure of an attorney left him suddenly penniless, and neither he nor his wife was willing to live in penury where they had enjoyed \u0027\u0027consideration\", \"priority\":12}]}, \"synonyms\":{}}");

	add("consigne", "{\"term\":\"consigne\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A countersign; a watchword\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who is ordered to keep within certain limits\", \"priority\":2}]}, \"synonyms\":{}}");

