	add("consistency", "{\"term\":\"consistency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Local coherence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Correspondence or compatibility\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Reliability or uniformity; the quality of being consistent\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That \u0027\u0027consistency\u0027\u0027 of behaviour whereby he inflexibly pursues those measures which appear the most just\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The degree of viscosity of something\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/4/stents-to-prevent-stroke Stents to Prevent passage\u003dAs we age, the major arteries of our bodies frequently become thickened with plaque, a fatty material with an oatmeal-like \u0027\u0027consistency\u0027\u0027 that builds up along the inner lining of blood vessels\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Freedom from contradiction; the state of a system of axioms such that none of the propositions deduced from them are mutually contradictory\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Firmness of constitution or character; substantiality; durability; persistency\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"His friendship is of a noble make and a lasting \u0027\u0027consistency\", \"priority\":10}]}, \"synonyms\":{}}");

	add("consociation", "{\"term\":\"consociation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin consociatio.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intimate union; fellowship; alliance; companionship; confederation; association; intimacy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Friendly \u0027\u0027consociation\u0027\u0027 with your kindred elements\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A voluntary and permanent council or union of neighboring Congregational churches, for mutual advice and cooperation in ecclesiastical matters; a meeting of pastors and delegates from churches thus united\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In Connecticut some of the Congregational churches are associated in \u0027\u0027consociations\u0027\u0027 and the others in associations\", \"priority\":4}]}, \"synonyms\":{}}");

	add("consociationalism", "{\"term\":\"consociationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Political consociation; government through guaranteed group representation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Hudson Meadwell, \u00278: Quebec Independence and Secession in the Developed West\u0027, Sukumar Periwal (editor), \u0027Notions of Nationalism\u0027, [http://books.google.com.au/books?id\u003d3bxuEngnpN0C\u0026amp;pg\u003dPA140\u0026amp;dq\u003d%22consociationalism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7F3VUf28FuLIiAeLuYBo\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22consociationalism%22\u0026amp;f\u003dfalse page 140\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Where \u0027\u0027consociationalism\u0027\u0027 and federalism overlay one another, moreover, the continuity of the latter depends on the stability of \u0027\u0027consociationalism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Ian Shapiro, \u0027Democracy\u0027s Place: Air Power and Coercion in War\u0027, [http://books.google.com.au/books?id\u003dcsYXj__xAmcC\u0026amp;pg\u003dPA102\u0026amp;dq\u003d%22consociationalism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7F3VUf28FuLIiAeLuYBo\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22consociationalism%22\u0026amp;f\u003dfalse page 102\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Consociationalism\u0027\u0027 has been described by its best-known proponent as a system of government based on a \u0026quot;cartel of elites.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Thomas G. Mitchell, \u0027Indispensable Traitors: Liberal Parties in Settler Conflicts\u0027, [http://books.google.com.au/books?id\u003d3q3wYR8gWusC\u0026amp;pg\u003dPA133\u0026amp;dq\u003d%22consociationalism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7F3VUf28FuLIiAeLuYBo\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22consociationalism%22\u0026amp;f\u003dfalse page 133\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The main weakness of \u0027\u0027consociationalism\u0027\u0027 is that its main successful cases have taken place in Western Europe among groups that have not been in open military conflict with each other. It cannot be established that those societies would not have remained peaceful without \u0027\u0027consociationalism\", \"priority\":10}]}, \"synonyms\":{}}");

	add("consolation", "{\"term\":\"consolation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027consolacion\u0027 (French. French|consolation)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of consoling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The prize or benefit for the loser\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A consolation goal\", \"priority\":3}]}, \"synonyms\":{}}");

	add("consoler", "{\"term\":\"consoler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|console|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who gives consolation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("consolitis", "{\"term\":\"consolitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|console|itis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A notional condition affecting video games released for game consoles, making them inferior to computer versions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("consommé", "{\"term\":\"consommé\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a clear broth made from reduced meat or vegetable stock, served either hot as a soup or chilled as a jell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, w:Virginia Virginia Woolf, \u0027w:Jacob\u0027s Jacob\u0027s Room\u0027, Vintage Classics, paperback edition, page 132\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For after washing at the hotel at Patras, Jacob had followed the tram lines a mile or so out; and followed them a mile or so back; he had met several droves of turkeys; several strings of donkeys; had got lost in back streets; had read advertisements of corsets and Maggi\u0027s \u0027\u0027consommé\u0027\u0027; children had trodden on his toes; the place smelt of bad cheese; and he was glad to find himself suddenly come out opposite his hotel\", \"priority\":3}]}, \"synonyms\":{}}");

	add("consonantism", "{\"term\":\"consonantism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|consonant|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The (study of the) consonant sounds of a language\", \"priority\":1}]}, \"synonyms\":{}}");

	add("consopiation", "{\"term\":\"consopiation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of sleeping, or of lulling to sleep\", \"priority\":1}]}, \"synonyms\":{}}");

	add("consort", "{\"term\":\"consort\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The spouse of a monarch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A husband, wife, companion or partner\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He single chose to live, and shunned to wed, / Well pleased to want a \u0027\u0027consort\u0027\u0027 of his bed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Thackera\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027consort\u0027\u0027 of the queen has passed from this troubled sphere\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Darwi\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the snow-white gander, invariably accompanied by his darker \u0027\u0027consort\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A ship accompanying another\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Association or partnership\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Atterbur\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Take it singly, and it carries an air of levity; but, in \u0027\u0027consort\u0027\u0027 with the rest, has a meaning quite different\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A group or company, especially of musicians playing the same type of instrument\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"In one \u0027\u0027consort\u0027\u0027 there sat / Cruel revenge and rancorous despite, / Disloyal treason, and heart-burning hate\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Herber\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Lord, place me in thy \u0027\u0027consort\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Harmony of sounds; concert, as of musical instruments\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"To make a sad \u0027\u0027consort\u0027\u0027, / Come, let us join our mournful song with theirs\", \"priority\":20}]}, \"synonyms\":{}}");

	add("consortium", "{\"term\":\"consortium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin consortio (\u0026quot;bound destiny; the same destiny\u0026quot;) prefix con- \u0026quot;with\u0026quot; + noun sortitus (\u0026quot;casting lots\u0026quot;, \u0026quot;decide by lots\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An association or combination of businesses, financial institutions, or investors, for the purpose of engaging in a joint venture\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A similar arrangement among non-commercial institutions or organizations\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An association or society\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The right of a spouse to all the normal relationships with his or her mate\", \"priority\":4}]}, \"synonyms\":{}}");

