	add("conspiracy", "{\"term\":\"conspiracy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman and Old french (842-ca. 1400) \u0027conspiracie\u0027 from Latin \u0027conspiratio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of two or more persons, called conspirators, working secretly to obtain some goal, usually understood with negative connotations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An agreement between two or more persons to break the law at some time in the future\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A group of ravens\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A situation in which different phonological or grammatical rules lead to similar or related outcomes\", \"priority\":4}]}, \"synonyms\":{}}");

