	add("conspirator", "{\"term\":\"conspirator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027conspiratour\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a group that acts in harmon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Part of a group that agree to do an unlawful or unethical act\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027conspirators\u0027\u0027 were rounded up by the police and arrested\", \"priority\":3}]}, \"synonyms\":{}}");

	add("constable", "{\"term\":\"constable\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027conestable\u0027 ( \u0026gt; French \u0027connétable\u0027 , from Latin {{m|la|comes stabulī||officer of the stables}}. For the sense-development, compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A police officer ranking below sergeant in most British/New Zealand police forces. (See also chief constable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d19|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dAs soon as Julia returned with a \u0027\u0027constable\u0027\u0027, Timothy, who was on the point of exhaustion, prepared to give over to him gratefully. The newcomer turned out to be a powerful youngster, fully trained and eager to help, and he stripped off his tunic at once\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Officer of a noble court in the middle ages, usually a senior army commander. (See also marshal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Public officer, usually at municipal level, responsible for maintaining order or serving writs and court orders\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A elected head of a parish (also known as a connétable\", \"priority\":5}]}, \"synonyms\":{}}");

	add("constantine", "{\"term\":\"constantine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the name of Roman emperors, Latin \u0027constans\u0027 (constant, steadfast)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Scene 2\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Helen, the mother of great \u0027\u0027Constantine\u0027\u0027 / Nor yet Saint Philip\u0027s daughters were like thee\", \"priority\":2}]}, \"synonyms\":{}}");

	add("constantinople", "{\"term\":\"constantinople\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027sc\u003dpolytonic|κωνσταντινούπολις\u0027 (constantine’s city) after Roman emperor w:Constantine I|Flavius Valerius Aurelius Constantinus (also known as Constantine I, St. Constantine, and/or Constantine the Great).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Name of present-day Istanbul from 330-1930 . Previously known as Byzantium\", \"priority\":1}]}, \"synonyms\":{}}");

