	add("constellation", "{\"term\":\"constellation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027constellacioun\u0027 \u0027constillacioun\u0027 from Middle french (ca. 1400-1600) \u0027constellation\u0027 from Latin {{m|la|constellātiō}}, from {{m|la|cōn||with}} + {{m|la|stēlla||star, astral body}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An asterism, an arbitrary formation of stars perceived as a figure or pattern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An image associated with a group of stars\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of the 88 officially recognized regions of the sky, including all stars and celestial bodies in the region\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The configuration of planets at a given time (notably of birth), as used for determining a horoscope\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A wide, seemingly unlimited assortment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027constellation\u0027\u0027 of possibilities\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a fleet of satellites of the same purpose\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A configuration or grouping\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Your computer\u0027s software \u0027\u0027constellation\u0027\u0027 helps you do your work faster\", \"priority\":9}]}, \"synonyms\":{}}");

	add("consternation", "{\"term\":\"consternation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French from Latin {{m|la|consternātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Amazement or horror that confounds the faculties, and incapacitates for reflection; terror, combined with amazement; dismay\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:Chuck Chuck Klosterman\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was probably worth four millennia of \u0027\u0027consternation\u0027\u0027 and regret\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Awakening\u0027, w:Kate Kate Chopin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Out!\u0026quot; exclaimed her husband, with something like genuine \u0027\u0027consternation\u0027\u0027 in his voice\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Terrance Dicks \u0026amp; Barry Letts, \u0027Deadly Reunion\u0027, chapter 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Their audience had been listening in increasing \u0027\u0027consternation\", \"priority\":7}]}, \"synonyms\":{}}");

	add("constipation", "{\"term\":\"constipation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|constīpātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Act of crowding anything into a lesser compass, or the state of being crowded or pressed together; condensation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A state of the bowels in which the evacuations are infrequent and difficult, or the intestines become filled with hardened faeces; costiveness\", \"priority\":2}]}, \"synonyms\":{}}");

	add("constitution", "{\"term\":\"constitution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027constitucion\u0027 (French. French|constitution), from Latin \u0027constitutio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act, or process of setting something up, or establishing something; the composition or structure of such a thing; its makeup\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir J. Hersche\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the physical \u0027\u0027constitution\u0027\u0027 of the su\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The formal or informal system of primary principles and laws that regulates a government or other institutions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Our \u0027\u0027constitution\u0027\u0027 had begun to exist in times when statesmen were not much accustomed to frame exact definitions\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A legal document describing such a formal system\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The general health of a person\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s physique or temperament\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Our \u0027\u0027constitutions\u0027\u0027 have never been enfeebled by the vices or luxuries of the old world\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Clarendo\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"He defended himself with less passion than was expected from his \u0027\u0027constitution\", \"priority\":12}]}, \"synonyms\":{}}");

	add("constitutionalism", "{\"term\":\"constitutionalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Philosophical belief in government under a written constitution\", \"priority\":1}]}, \"synonyms\":{}}");

