	add("construct", "{\"term\":\"construct\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla|construo\u0027 () from \u0027lang\u003dla|com-\u0027 () + \u0027lang\u003dla|struo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something constructed from parts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The artwork was a \u0027\u0027construct\u0027\u0027 of wire and tubes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Loops and conditional statements are \u0027\u0027constructs\u0027\u0027 in computer programming\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A concept or model\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Bohr\u0027s theoretical \u0027\u0027construct\u0027\u0027 of the atom was soon superseded by quantum mechanics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"genetics) A segment of nucleic acid, created artificially, for transplantation into a target cell or tissue\", \"priority\":6}]}, \"synonyms\":{}}");

