	add("construction", "{\"term\":\"construction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027construction\u0027 from Latin {{m|la|cōnstructiō}}, from {{m|la|cōnstruere}}, present active infinitive of {{m|la|cōnstruō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of constructing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Construction\u0027\u0027 is underway on the new bridge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything that has been constructed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The engineer marvelled at his \u0027\u0027construction\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The trade of building structures\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He had worked in \u0027\u0027construction\u0027\u0027 all his life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A building, model or some other structure\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The office was a \u0027\u0027construction\u0027\u0027 of steel and glass\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A (usually non-representational) structure, such as a collage etc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Construction\u0027\u0027 in string and clockwork\u0026quot; took first prize\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The manner in which something is built\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A thing of simple \u0027\u0027construction\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A group of words arranged to form a meaningful phrase\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The act or result of construing the meaning of something\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"American conservatives tend to favor strict \u0027\u0027construction\u0027\u0027 of the Constitution\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The meaning or interpretation of a text, action etc.; the way something is viewed by an observer or onlooker\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Hilary Mantel, \u0027A Place of Greater Safety\u0027, Harper Perennial 2007, p. 95\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"He had considered sending Lucille away to stay with relations. But then people might have put the worst \u0027\u0027construction\u0027\u0027 on it – might believe she had done something she shouldn\u0027t have\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A geometric figure of arcs and line segments that is drawable with a straightedge and compass\", \"priority\":19}]}, \"synonyms\":{}}");

	add("constructionism", "{\"term\":\"constructionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|construction|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strict interpretation of the actual words and phrases used in law, rather to any underlying inten\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The idea that people learn about, or perceive the world by constructing mental model\", \"priority\":2}]}, \"synonyms\":{}}");

	add("constructivism", "{\"term\":\"constructivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|constructive|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Russian movement in modern art characterized by the creation of nonrepresentational geometric objects using industrial materials\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A philosophy that asserts the need to construct a mathematical object to prove it exists\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A psychological epistemology which argues that humans generate knowledge and meaning from their experiences\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Donald Kiraly, \u0027A Social Constructivist Approach to Translator Education\u0027, St. Jerome Publishing, p. 18\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is no single theory of \u0027\u0027constructivism\u0027\u0027. In fact, there are many shades and varieties of \u0027\u0027constructivism\u0027\u0027 spanning a range of perspectives. There is also no single individual who can be identified as the founder of \u0027\u0027constructivism\u0027\u0027. In fact, rather than tracing a linear development along one line of philosophical thought, \u0027\u0027constructivism\u0027\u0027 seems to circumscribe a set of thinkers, theories and approaches that spring from a plethora of historical and cultural origins\", \"priority\":5}]}, \"synonyms\":{}}");

	add("construer", "{\"term\":\"construer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|construe|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who construes somethin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"By locating the addicted person in these categories, the \u0027\u0027construer\u0027\u0027 places the addicted person into superordinate categories shared by other persons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thus, the provision of Sections 18 and 19 are to be considered more persuasive to a \u0027\u0027construer\u0027\u0027 than Section 20\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Constructs with good predictive efficiency allow the \u0027\u0027construer\u0027\u0027 to make sound predictions about what is likely to happen next in their world\", \"priority\":4}]}, \"synonyms\":{}}");

	add("consubstantiation", "{\"term\":\"consubstantiation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An identity or union of substance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The actual, substantial presence of the body of Christ with the bread and wine of the sacrament of the Lord\u0027s Supper; impanation, as opposed to transubstantiation\", \"priority\":2}]}, \"synonyms\":{}}");

	add("consuetude", "{\"term\":\"consuetude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027consuetude\u0027 from Latin {{m|la|cōnsuētūdō||custom}}, from {{m|la|cōnsuēscō||accustom, habituate; accustom oneself}}, corresponding to \u0027con-\u0027 (with) + {{m|la|suēscō||become accustomed}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Custom, familiarity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, w:Walter Walter Scott, Ivanho\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“the stain hath become engrained by time and \u0027\u0027consuetude\u0027\u0027; let thy reformation be cautious, as it is just and wise.”\", \"priority\":3}]}, \"synonyms\":{}}");

	add("consul", "{\"term\":\"consul\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from Latin {{m|la|cōnsul}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An official residing in a foreign country in order to protect the interests of citizens from his or her nation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Either of the two highest-ranking officials of the Roman Republic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of the three chief magistrates of France from 1799 to 1804\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A senator; a counsellor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Many of the \u0027\u0027consuls\u0027\u0027, raised and met, / Are at the duke\u0027s already\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Bible, Job. iii. 14 (Douay version\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"With kings and \u0027\u0027consuls\u0027\u0027 of the earth\", \"priority\":8}]}, \"synonyms\":{}}");

	add("consulate", "{\"term\":\"consulate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The residency of a consu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In practice, an office of a government in a foreign city that oversees the distribution of visas and provides assistance to nationals\", \"priority\":2}]}, \"synonyms\":{}}");

	add("consult", "{\"term\":\"consult\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027consulter\u0027 from Latin \u0027consultare\u0027 (to deliberate, consult) frequentative of \u0027consulere\u0027 () from \u0027com-\u0027 () + \u0027\u0027 of uncertain origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of consulting or deliberating; consultation; also, the result of consultation; determination; decision\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The council broke; And all grave \u0027\u0027consults\u0027\u0027 dissolved in smoke.\u0027 -w:John John Dryden\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A council; a meeting for consultation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027consult\u0027\u0027 of coquettes.\u0027 -w:Jonathan Jonathan Swift\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Agreement; concert\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A visit, e.g. to a doctor; a consultation\", \"priority\":6}]}, \"synonyms\":{}}");

