	add("consultation", "{\"term\":\"consultation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of consultin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a conference for the exchange of information and advic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An appointment or meeting with a professional person, such as a doctor\", \"priority\":3}]}, \"synonyms\":{}}");

