	add("consumer", "{\"term\":\"consumer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{affix|en|consume|-er}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, consumes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"someone who trades money for goods as an individual\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This new system favours the \u0027\u0027consumer\u0027\u0027 over the producer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"an organism (heterotroph) that uses other organisms for food in order to gain energy\", \"priority\":4}]}, \"synonyms\":{}}");

