	add("consumption", "{\"term\":\"consumption\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027consumpcion\u0027 from Latin \u0027consumptio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of consuming something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fire\u0027s \u0027\u0027consumption\u0027\u0027 of the forest caused ecological changes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The amount consumed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"gross national \u0027\u0027consumption\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The waste wasting-away of the human body through disease\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"pulmonary Pulmonary tuberculosis\", \"priority\":6}]}, \"synonyms\":{}}");

