	add("contagion", "{\"term\":\"contagion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) (late 14th century), from Old french (842-ca. 1400) from Latin \u0027contagio\u0027 (a touching, contact, contagion) related to \u0027contingo\u0027 (touch closely)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A disease spread by contac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The spread or transmission of such a diseas\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The spread of anything harmful, as if it were such a diseas\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A situation in which small shocks, which initially affect only a few financial institutions or a particular region of an economy, spread to the rest of financial sectors and other countries whose economies were previously healthy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:George George Soros, Project Syndicate, \u0027[https://www.project-syndicate.org/commentary/soros69/English Germany Must Defend the Euro\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And it was German procrastination that aggravated the Greek crisis and caused the \u0027\u0027contagion\u0027\u0027 that turned it into an existential crisis for Europe\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A resulting recession or crisis developed in such manner\", \"priority\":7}]}, \"synonyms\":{}}");

	add("contagionist", "{\"term\":\"contagionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|contagion|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who believes in the contagious character of certain diseases, such as yellow fever\", \"priority\":1}]}, \"synonyms\":{}}");

