	add("container", "{\"term\":\"container\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|contain}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An item in which objects, materials or data can be stored or transported\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A very large, typically metal, box used for transporting goods (also cargo container\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"someone who holds people in their seats or in a (reasonably) calm state\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A file format that can hold various types of data\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Cory Altheide, Harlan Carvey, \u0027Digital Forensics with Open Source Tools\u0027 (page 187\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"As the MP4 \u0027\u0027container\u0027\u0027 can store audio, video, or both, the M4A naming and file extension is used to hint that this MP4 container holds solely audio information\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any user interface component that can hold further (child) components\", \"priority\":7}]}, \"synonyms\":{}}");

	add("containment", "{\"term\":\"containment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|contain|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being contained\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of containing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something contained\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a policy of checking the expansion of a hostile foreign power by creating alliances with other states; especially the foreign policy strategy of the United States in the early years of the Cold War\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a physical system designed to prevent the accidental release of radioactive or other dangerous materials from a nuclear reactor or industrial plant\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"an inclusion\", \"priority\":6}]}, \"synonyms\":{}}");

	add("contaminant", "{\"term\":\"contaminant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which contaminates; an impurity; foreign matter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Keep the lid on the jar to keep \u0027\u0027contaminants\u0027\u0027 out\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contamination", "{\"term\":\"contamination\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of contaminating; pollution; defilement; taint; also, that which contaminates\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A process whereby words with related meanings come to have similar sounds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The influence of one form (often from a foreign language) on the historical development of another form to which it may be related in meaning\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The process of making a material or surface unclean or unsuited for its intended purpose, usually by the addition or attachment of undesirable foreign substances\", \"priority\":4}]}, \"synonyms\":{}}");

	add("contemplation", "{\"term\":\"contemplation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027contemplation\u0027 from Latin \u0027contemplatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of the mind in considering with attention; continued attention of the mind to a particular subject; meditation; musing; study\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Holy meditation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of looking forward to an event as about to happen; expectation; the act of intending or purposing\", \"priority\":3}]}, \"synonyms\":{}}");

