	add("contempt", "{\"term\":\"contempt\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla|contemptus\u0027 () from \u0027lang\u003dla|contemnere\u0027 () from \u0027lang\u003dla\u0027 + \u0027lang\u003dla|temnere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or act of contemning; the feeling or attitude of regarding someone or something as inferior, base, or worthless; scorn, disdain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAnd Vickers launched forth into a tirade very different from his platform utterances. He spoke with extreme \u0027\u0027contempt\u0027\u0027 of the dense stupidity exhibited on all occasions by the working classes. He said that if you wanted to do anything for them, you must rule them, not pamper them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being despised or dishonored; disgrace\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Open disrespect or willful disobedience of the authority of a court of law or legislative body\", \"priority\":4}]}, \"synonyms\":{}}");

	add("contender", "{\"term\":\"contender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|contend}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who competes with one or more other people\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contention", "{\"term\":\"contention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027contencion\u0027 from Old french (842-ca. 1400) \u0027contencion\u0027 from Latin \u0027contentio\u0027 from \u0027\u0027 past participle \u0027contentus\u0027 () see contend.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"struggle, contest, strife, argument, debat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A point maintained in an argument, or a line of argument taken in its support; the subject matter of discussion of strife; a position taken or contended for\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is my \u0027\u0027contention\u0027\u0027 that state lotteries are taxes on stupid people\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Competition by parts of a system or its users for a limited resource\", \"priority\":4}]}, \"synonyms\":{}}");

	add("contentiousness", "{\"term\":\"contentiousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being contentious\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contentment", "{\"term\":\"contentment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"Middle french (ca. 1400-1600) \u0027contentement\u0027 synchronically analyzable as {{suffix|content|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state or degree of being contente\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, w:Kenneth Kenneth Grahame, \u0027w:The Wind in the The Wind in the Willows\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then they got out their boat from the boat-house, sculled down the river home, and at a very late hour sat down to supper in their own cosy riverside parlour, to the Rat\u0027s great joy and contentment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"happiness in one\u0027s situation; satisfactio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the neurophysiological experience of satisfaction and being at ease in one\u0027s situation, body, and/or mind\", \"priority\":5}]}, \"synonyms\":{}}");

	add("contents", "{\"term\":\"contents\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is contained\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It is not covered in your homeowner\u0027s policy. You need \u0027\u0027contents\u0027\u0027 insurance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027contents\u0027\u0027 of the cup had a familiar aroma\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"most of Edison\u0027s grounds soon became an inferno. As though on an incendiary rampage, the fires systematically devoured the \u0027\u0027contents\u0027\u0027 of Edison\u0027s headquarters and facilities\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A table of contents, a list of chapters, etc. in a book, and the page numbers on which they start\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I always start a book by reading the dustjacket and the \u0027\u0027contents\u0027\u0027 before I really dig in to the content itself\", \"priority\":6}]}, \"synonyms\":{}}");

	add("contest", "{\"term\":\"contest\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From French \u0027contester\u0027 from Old french (842-ca. 1400) from Latin \u0027contestor\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Controversy; debate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"no \u0027\u0027contest\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Struggle for superiority; combat\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A competition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The child entered the spelling \u0027\u0027contest\", \"priority\":5}]}, \"synonyms\":{}}");

	add("contestation", "{\"term\":\"contestation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of contesting; emulation; rivalry; strife; dispute\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Proof by witness; attestation; testimony\", \"priority\":2}]}, \"synonyms\":{}}");

	add("context", "{\"term\":\"context\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027contextus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The surroundings, circumstances, environment, background or settings that determine, specify, or clarify the meaning of an event or other occurrence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In what \u0027\u0027context\u0027\u0027 did your attack on him happen? - We had a pretty tense relationship at the time, and when he insulted me I snapped\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The text in which a word or passage appears and which helps ascertain its meaning\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The surroundings and environment in which an artifact is found and which may provide important clues about the artifact\u0027s function and/or cultural meaning\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The trama or flesh of a mushroom\", \"priority\":5}]}, \"synonyms\":{}}");

	add("contextomy", "{\"term\":\"contextomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|context|tomy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice (or act) of quoting a person (or people) out of context, often with the aim of winning an argument, often intending obfuscation of the quote\u0027s actual meaning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contextualism", "{\"term\":\"contextualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|contextual|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of doctrines that stress the importance of contex\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contexture", "{\"term\":\"contexture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A weaving together of parts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A body or structure made by interweaving or assembling parts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The arrangement and union of the constituent parts of a thing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The structural character of a thing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sir H. Wotto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He was not of any delicate \u0027\u0027contexture\u0027\u0027; his limbs rather sturdy than dainty\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Context\", \"priority\":7}]}, \"synonyms\":{}}");

	add("contiguity", "{\"term\":\"contiguity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027contiguïté\u0027 from {{m|la|contiguitās}}, from Latin \u0027contiguus\u0027 (bordering upon) from {{m|la|contingō||I touch or border upon}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state in which two or more physical objects are physically touching one another or in which sections of a plane border on one another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958–1960\u0027\u0027, w:Richard Stanley R.S. Peters, \u0027The Concept of Motivation\u0027, Routledge \u0026amp; Kegan Paul (second edition), chapter i: “Types of Explanation in Psychological Theories”, page 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the mechanical conception of ‘cause’ it is…demanded that there should be spatial and temporal \u0027\u0027contiguity\u0027\u0027 between the movements involved\", \"priority\":3}]}, \"synonyms\":{}}");

	add("continence", "{\"term\":\"continence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Dated from the 14th Century {{C.E.}}; from Old french (842-ca. 1400) \u0027continence\u0027 from Latin \u0027continentia\u0027 (a {{l) lang\u003dla}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The voluntary control of urination and defecation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Moderation or self-restraint, especially in sexual activity; abstinence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He knew what to say; he knew also, when to leave off, \u0026amp;mdash; a \u0027\u0027continence\u0027\u0027 which is practiced by few writers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Jeremy Taylo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Chastity is either abstinence or \u0027\u0027continence\u0027\u0027: abstinence is that of virgins or widows; \u0027\u0027continence\u0027\u0027, that of married persons\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Uninterrupted course; continuity\", \"priority\":7}]}, \"synonyms\":{}}");

	add("contingent", "{\"term\":\"contingent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027contingent\u0027 from \u0027lang\u003dla|contingens\u0027 () properly present participle of Latin \u0027lang\u003dla|contingere\u0027 () from \u0027lang\u003dla|com-\u0027 () + \u0027lang\u003dla|tangere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An event which may or may not happen; that which is unforeseen, undetermined, or dependent on something future; a contingency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which falls to one in a division or apportionment among a number; a suitable share; proportion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A quota of troops\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Ian Black, \u0026quot;[http://www.theguardian.com/world/2014/nov/27/-sp-courts-jordan-crush-support-isis Courts kept busy as Jordan works to crush support for Isis]\u0026quot;, \u0027The Guardian\u0027, 27 November 2014\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Arrests and prosecutions intensified after Isis captured Mosul in June, but the groundwork had been laid by an earlier amendment to Jordan’s anti-terrorism law. It is estimated that 2,000 Jordanians have fought and 250 of them have died in Syria – making them the third largest Arab \u0027\u0027contingent\u0027\u0027 in Isis after Saudi Arabians and Tunisians\", \"priority\":5}]}, \"synonyms\":{}}");

	add("continuant", "{\"term\":\"continuant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|continue|ant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A linguistic sound other than a sto\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A determinant formed from a tridiagonal matrix\", \"priority\":2}]}, \"synonyms\":{}}");

	add("continuation", "{\"term\":\"continuation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027continuation\u0027 from Latin \u0027continuatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or state of continuing; the state of being continued; uninterrupted extension or succession; prolongation; propagation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which extends, increases, supplements, or carries on\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027continuation\u0027\u0027 of a story\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The series\u0027 \u0027\u0027continuation\u0027\u0027 was commercially if not artistically successful\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A representation of an execution state of a program at a certain point in time, which may be used at a later time to resume the execution of the program from that point\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A successful shot that, despite a foul, is made with a single continuous motion beginning before the foul, and that is therefore valid in certain forms of basketball\", \"priority\":6}]}, \"synonyms\":{}}");

	add("continuationism", "{\"term\":\"continuationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The concept, especially amongst charismatic Christians, that the works of the Holy Spirit (speaking in tongues, prophecy, healing, and miracles) continue in the modern world\", \"priority\":1}]}, \"synonyms\":{}}");

	add("continuer", "{\"term\":\"continuer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|continue|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, continues\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Peter Perciles Trifonas, ‎Themistoklis Aravossitas, \u0027Rethinking Heritage Language Education\u0027 (page 71\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Under the current CCAFL scheme, syllabuses are developed at three levels: beginners, \u0027\u0027continuers\u0027\u0027 (second language) and background/first language speakers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A word or phrase interjected by the listener to indicate that he/she is listening to the speaker\", \"priority\":4}]}, \"synonyms\":{}}");

	add("continuity", "{\"term\":\"continuity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027continuité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lack of interruption or disconnection; the quality of being continuous in space or time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Considerable \u0027\u0027continuity\u0027\u0027 of attention is needed to read German philosophy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A characteristic property of a continuous function\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A narrative device in episodic fiction where previous and/or future events in a story series are accounted for in present stories\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Consistency between multiple shots depicting the same scene but possibly filmed on different occasions\", \"priority\":5}]}, \"synonyms\":{}}");

	add("continuo", "{\"term\":\"continuo\", \"etymology\":{\"influencers\":[], \"languages\":[\"Spanish\", \"Latin\"], \"text\":\"From Latin \u0027continuus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bass line of music, especially for a keyboard instrument, that continues throughout a work\", \"priority\":1}]}, \"synonyms\":{}}");

	add("continuousness", "{\"term\":\"continuousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being continuous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("continuum", "{\"term\":\"continuum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027continuum\u0027 neuter form of \u0027continuus\u0027 from {{m|la|contineō||contain, enclose}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A continuous series or whole, no part of which is noticeably different from its adjacent parts, although the ends or extremes of it are very different from each other\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A continuous extent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dOpening volume\u003d100|issue\u003d2|page\u003d112-3|magazine\u003dw:American American url\u003dhttp://www.americanscientist.org/issues/pub/opening-doors|passage\u003dA doorknob of whatever roundish shape is effectively a \u0027\u0027continuum\u0027\u0027 of levers, with the axis of the latching mechanism\u0026amp;mdash;known as the spindle\u0026amp;mdash;being the fulcrum about which the turning takes place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The set of all real numbers and, more generally, a compact connected metric space\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A touch-sensitive strip, similar to an electronic standard musical keyboard, except that the note steps are of a semitone, and so are not separately marked\", \"priority\":5}]}, \"synonyms\":{}}");

	add("contoid", "{\"term\":\"contoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A phonetic consonant, as opposed to a phonological one\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contraband", "{\"term\":\"contraband\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027contrebande\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any goods which are illicit or illegal to posses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"goods which are prohibited from being traded, smuggled good\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A black slave during the American Civil War who had escaped to, or been captured by, Union forces\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, James McPherson, \u0027Battle Cry of Freedom\u0027, Oxford 2003, p. 497\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"While some Yanks treated \u0027\u0027contrabands\u0027\u0027 with a degree of equity or benevolence, the more typical response was indifference, contempt, or cruelty\", \"priority\":5}]}, \"synonyms\":{}}");

	add("contraction", "{\"term\":\"contraction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027contraction\u0027 from Latin {{m|la|contractiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reversible reduction in size\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A period of economic decline or negative growth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The country\u0027s economic \u0027\u0027contraction\u0027\u0027 was caused by high oil prices\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A shortening of a muscle when it is used\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A strong and often painful shortening of the uterine muscles prior to or during childbirth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A process whereby one or more sounds of a free morpheme (a word) are lost or reduced, such that it becomes a bound morpheme (a clitic) that attaches phonologically to an adjacent word\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In English \u0027didn\u0027t\u0027, \u0027that\u0027s\u0027, and \u0027wanna\u0027, the endings \u0027-n\u0027t\u0027, \u0027-\u0027s\u0027, and \u0027-a\u0027 arose by \u0027\u0027contraction\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A word with omitted letters replaced by an apostrophe, usually resulting from the above process\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;Don\u0027t\u0026quot; is a \u0027\u0027contraction\u0027\u0027 of \u0026quot;do not.\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Contracting a disease\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027contraction\u0027\u0027 of AIDS from toilet seats is extremely rare\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Syncope, the loss of sounds from within a word\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The acquisition of something, generally negative\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Our \u0027\u0027contraction\u0027\u0027 of debt in this quarter has reduced our ability to attract investors\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A distinct stage of wound healing, wherein the wound edges are gradually pulled together\", \"priority\":15}]}, \"synonyms\":{}}");

	add("contractor", "{\"term\":\"contractor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or company that builds or improves buildings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person or company that performs specific tasks like electrical or plumbing work in construction projects\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person or company hired to maintain existing facilities like air conditioning systems, groundskeeping, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person hired to do a job on a business contract, as opposed to a permanent employee\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, w:Scott Scott Adams, [http://dilbert.com/strips/comic/1994-10-21/ Dilbert\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It looks like you\u0027re off to a three-hour staff meeting that doesn\u0027t apply to me. I\u0027m glad I\u0027m a highly-paid \u0027\u0027contractor\u0027\u0027. I\u0027ll be increasing my skills while you fight to get oxygen to your brains\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Three hours later)\u0027 I became a multimedia developer. How was your day\", \"priority\":7}]}, \"synonyms\":{}}");

	add("contradiction", "{\"term\":\"contradiction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027contradiction\u0027 from Latin {{m|la|contrādictiō}}, from {{m|la|contrādīcō||speak against}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of contradicting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His contradiction of the proposal was very interesting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A statement that contradicts itself, i.e., a statement that makes a claim that the same thing is true and that it is false at the same time and in the same senses of the terms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There is a contradiction in Clarence Page\u0027s statement that a woman should have the right to choose and decide for herself whether to have an abortion, and at the same time she should not have that right\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is a contradiction in what you say - she can\u0027t be both married and single\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"a logical incompatibility among two or more elements or proposition\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Marx believed that the contradictions of capitalism would lead to socialism\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A proposition that is false for all values of its variables\", \"priority\":8}]}, \"synonyms\":{}}");

	add("contraflow", "{\"term\":\"contraflow\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|contra|flow|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Flow in the opposite direction to normal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An abnormal state of a road or motorway where the traffic temporarily travels in the opposite direction to normal, usually as a result of repair work or an accident\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contragestion", "{\"term\":\"contragestion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Prevention of the implantation of a blastocyst\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contrail", "{\"term\":\"contrail\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|condensation|trail|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An artificial cloud made by the exhaust of jet aircraft or wingtip vortices that precipitate a stream of tiny ice crystals in moist, frigid upper air\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contraindication", "{\"term\":\"contraindication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A factor or symptom which makes a certain treatment inadvisable, generally or individually\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contralto", "{\"term\":\"contralto\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Contraction of \u0027contratenor alto\u0027, from Latin \u0027contratenor altus\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The lowest female voice or voice part, falling between tenor and mezzo-soprano. The terms contralto and alto refer to a similar musical pitch, but among singers, the term contralto is reserved for female singers; the equivalent male form is counter-tenor. Originally the contratenor altus was a high countermelody sung against the tenor or main melody\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contraption", "{\"term\":\"contraption\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Possibly a Western US English dialectical word. {{unk.|en}} origin. Perhaps from \u0027contrive\u0027 + \u0027trap\u0027 + \u0027\u0027 Chambers suggests \u0027contrivance\u0027 + \u0027adaption\u0027 lt;ref\u0026gt;Chambers Dictionary, Edinburgh, 1998, s.v.\u0026lt;/ref\u0026gt;. Neither Chambers nor Concise Oxford suggests a US origin. cf \u0027cantrip\u0027 (Scots dialect), a wilful piece of trickery.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A machine that is complicated and precarious\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any object\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contrarian", "{\"term\":\"contrarian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"c 1660 {{suffix|contrary|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person who expresses a contradicting viewpoint, especially one who denounces the majority persuasio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a financial investor who tends to have an opinion of market trends at variance with most others\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contrarotation", "{\"term\":\"contrarotation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|contra|rotation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of a single piston or turboprop engine to drive two propellers in opposite rotation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contrast", "{\"term\":\"contrast\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French \u0027contraster\u0027 from Italian \u0027contrastare\u0027 (lang\u003dit) from from Latin \u0027contra\u0027 (lang\u003dla) + \u0027sto\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A difference in lightness, brightness and/or hue between two colours that makes them more or less distinguishable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The degree of this difference\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A control on a television, etc, that adjusts the amount of contrast in the images being displayed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A difference between two objects, people or concepts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The colonel and his sponsor made a queer \u0027\u0027contrast\u0027\u0027: Greystone [the sponsor] long and stringy, with a face that seemed as if a cold wind was eternally playing on it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Antithesis\", \"priority\":6}]}, \"synonyms\":{}}");

	add("contrastiveness", "{\"term\":\"contrastiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|contrastive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being contrastive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("contretemps", "{\"term\":\"contretemps\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unforeseen, inopportune, or embarrassing event; a hitc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ill-timed pass\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contribution", "{\"term\":\"contribution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027contribution\u0027 from Latin \u0027contributionem\u0027, from \u0027contribuere\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something given or offered that adds to a larger whole\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An amount of money given toward something\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of contributing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The taking part, often with the idea that it has lead to (scientific etc.) progress\", \"priority\":4}]}, \"synonyms\":{}}");

	add("contrition", "{\"term\":\"contrition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027contriciun\u0027 (French \u0027contrition\u0027 , from Latin \u0027contritio\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being contrite; sincere penitence or remorse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of grinding or rubbing to powder; attrition; friction; rubbing\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contrivance", "{\"term\":\"contrivance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|contrive|ance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a (mechanical) device to perform a certain tas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a means, such as an elaborate plan or strategy, to accomplish a certain objectiv\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Plato, \u0027Sophist\u0027. Translation by Lesley Brown. w:Stephanus 266b\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And along with each of these go their images, not the things themselves, — they too have come about by godlike \u0027\u0027contrivance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"something overly artful or artificial\", \"priority\":5}]}, \"synonyms\":{}}");

	add("controllability", "{\"term\":\"controllability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|controllable|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being controllable; controllableness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("controllableness", "{\"term\":\"controllableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|controllable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being controllable; the capability of being controlled\", \"priority\":1}]}, \"synonyms\":{}}");

	add("controversialist", "{\"term\":\"controversialist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|controversial|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who regularly engages in public controversies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Richard Dawkins has become a leading \u0027\u0027controversialist\u0027\u0027 in a few areas\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"John Worthingto\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His indefatigable adversary, who is the perfect model of an agile \u0027\u0027controversialist\u0027\u0027, had attacked him as a magniloquent Thraso, on account of his Pansophical promises\", \"priority\":4}]}, \"synonyms\":{}}");

	add("controversialness", "{\"term\":\"controversialness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being controversial\", \"priority\":1}]}, \"synonyms\":{}}");

	add("controverter", "{\"term\":\"controverter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|controvert|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who controverts; a controversial writer; a controversialist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Some \u0027\u0027controverters\u0027\u0027 in divinity are like swaggerers in a tavern.\u0027 \u0026amp;mdash; Ben Jonson\", \"priority\":2}]}, \"synonyms\":{}}");

	add("contumely", "{\"term\":\"contumely\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027contumelie\u0027 () from Latin {{m|la|contumēlia||insult}}, perhaps from \u0027com-\u0027 () + {{m|la|tumeō||swell}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Offensive and abusive language or behaviour; scorn, insult\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"For who would beare the Whips and Scornes of time, The Oppressors wrong, the poore mans \u0027\u0027Contumely\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1857\u0027\u0027, Anthony Trollope, Barchester Towers\u0027, Volume the Second, page 19 (ISBN 1857150570\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She had been subjected to \u0027\u0027contumely\u0027\u0027 and cross-questoning and ill-usage through the whole evening\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1914\u0027\u0027, \u0027The Best Man\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What scorn, what \u0027\u0027contumely\u0027\u0027, would be his\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1953\u0027\u0027, translating Sigmund Freud, \u0027The Interpretation of Dreams\u0027, Avon Books, p. 178\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"If this picture of the two psychical agencies and their relation to the consciousness is accepted, there is a complete analogy in political life to the extraordinary affection which I felt in my dream for my friend R., who was treated with such \u0027\u0027contumely\u0027\u0027 during the dream\u0027s interpretation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, \u0027Falstaff\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I could think of no words adequate to the occasion. So I belched. Not out of \u0027\u0027contumely\u0027\u0027, you understand. It was a sympathetic belch, a belch of brotherhood\", \"priority\":10}]}, \"synonyms\":{}}");

	add("conundrum", "{\"term\":\"conundrum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A word of unknown origin with several variants, gaining popularity for its burlesque imitation of scholastic Latin, as \u0026quot;hocus-pocus\u0026quot; or \u0026quot;panjandrum\u0026quot;. If there is more to its origin than a nonce coinage, Anatoly Liberman suggests the best theory is that connecting it with the \u0027w:Conimbricenses|Conimbricenses\u0027, 16C scholastic commentaries on Aristotle by the Jesuits of Coimbra which indulge heavily in arguments relying on multiple significations of words. [http://blog.oup.com/2008/12/conundrum/]\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A difficult question or riddle, especially one using a play on words in the answer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1816\u0027\u0027, w:Jane Jane Austen, Emma\u0027, s:Emma/Volume 1/Chapter Vol. 1, Ch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“Why should I understand that, or anything else?” asked the girl. “Don’t bother my head by asking \u0027\u0027conundrums\u0027\u0027, I beg of you. Just let me discover myself in my own way\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A difficult choice or decision that must be made\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, w:Martha Martha Stewart, [http://www.ksdk.com/printfullstory.aspx?storyid\u003d63793 statement read before being sentenced to five months in prison\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And while I am more concerned about the well-being of others than for myself, more hurt for them and for their losses than for my own, more worried for their futures than for the future of Martha Stewart the person, you are faced with a \u0027\u0027conundrum\u0027\u0027, a problem of monumental, to me, proportions\", \"priority\":6}]}, \"synonyms\":{}}");

	add("conurbation", "{\"term\":\"conurbation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Coined by w:en:Patrick Geddes|Sir Patrick Geddes in 1915. From Latin \u0027con-\u0027 (together) + \u0027urbs\u0027 (city)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a continuous aggregation of built-up urban communities created as a result of urban sprawl\", \"priority\":1}]}, \"synonyms\":{}}");

	add("conure", "{\"term\":\"conure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many New World parakeets of the former genus , now reassigned to other genera in tribe Arini, principally and\", \"priority\":1}]}, \"synonyms\":{}}");

	add("convallasaponin", "{\"term\":\"convallasaponin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular steroid glycoside\", \"priority\":1}]}, \"synonyms\":{}}");

	add("convection", "{\"term\":\"convection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027convectionem\u0027 from \u0027convectio\u0027 () from \u0027\u0027 past participle of \u0027convehere\u0027 () combination of \u0027\u0027 and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of conveying something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The transmission of heat in a fluid or gas by the circulation of currents\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The vertical movement of heat and moisture, especially by updrafts and downdrafts in an unstable air mass. The terms convection and thunderstorm are often used interchangeably, although thunderstorms are only one form of convection. Towering cumulus clouds are visible forms of convection\", \"priority\":3}]}, \"synonyms\":{}}");

	add("convector", "{\"term\":\"convector\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|convect|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A space heater that transfers heat by convection; a radiator\", \"priority\":1}]}, \"synonyms\":{}}");

	add("convenance", "{\"term\":\"convenance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027convenance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"conventional propriety\", \"priority\":1}]}, \"synonyms\":{}}");

	add("convenience", "{\"term\":\"convenience\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 from \u0027lang\u003dla|conveniens\u0027 () present participle of \u0027lang\u003dla|convenire\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the quality of being suitable, useful or convenien\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Let\u0027s further think of this; / Weigh what \u0027\u0027convenience\u0027\u0027 both of time and means / May fit us to our shape\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"anything that makes for an easier lif\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thus first Necessity invented stools, \u0027\u0027Convenience\u0027\u0027 next suggested elbow-chair\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A pair of spectacles and several other little \u0027\u0027conveniences\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Fast food is popular because of its cost and \u0027\u0027convenience\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"a convenient time, especially in the phrase \u0027at one\u0027s convenience\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"a public toilet\", \"priority\":11}]}, \"synonyms\":{}}");

