	add("convent", "{\"term\":\"convent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027covent\u0027 from Latin \u0027conventus\u0027 perfect participle of the verb \u0027convenio\u0027 see \u0027con-\u0027 \u0027venio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A religious community whose members (especially nuns) live under strict observation of religious rules and self-imposed vows\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The buildings and pertaining surroundings in which such a community lives\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One seldom finds in Italy a spot of ground more agreeable than ordinary that is not covered with a \u0027\u0027convent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A gathering of people lasting several days for the purpose of discussing or working on topics previously selected\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A coming together; a meeting\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Ben Jonso\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a usual ceremony at their [the witches\u0027] \u0027\u0027convents\u0027\u0027 or meetings\", \"priority\":8}]}, \"synonyms\":{}}");

	add("convention", "{\"term\":\"convention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Recorded since c. 1440, from Middle french (ca. 1400-1600) \u0027convention\u0027 from Latin {{m|la|conventiō||meeting, assembling; agreement, convention}}, from {{m|la|conveniō||come, gather or meet together, assemble}}, from \u0027con-\u0027 (with, together) + {{m|la|veniō||come}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A meeting or gathering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027convention\u0027\u0027 was held in Geneva\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A formal deliberative assembly of mandated delegates\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The EU installed an inter-institutional \u0027\u0027Convention\u0027\u0027 to draft a European constitutio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The convening of a formal meeting\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A formal agreement, contract or pact\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A treaty or supplement to such\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Vienna \u0027\u0027convention\u0027\u0027 at the Vienna Congress (1814-15) standardized most of diplomatic conduct for generation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A generally accepted principle, method or behaviour\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In order to account for this, we might propose to make the Prepositional Phrase an \u0027optional\u0027 constituent of the Verb Phrase: this we could do by re-\u0026lt;br\u0026gt; placing rule (28) (ii) by rule (40) below:\u0026lt;br\u0026gt;(40) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; VP \u0026amp;rarr; V AP (PP)\u0026lt;br\u0026gt;(Note that a constituent in parentheses is, by \u0027\u0027convention\u0027\u0027, taken to be\u0026lt;br\u0026gt; optional\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Table seatings are generally determined by tacit \u0027\u0027convention\u0027\u0027, not binding formal protoco\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027convention\u0027\u0027 of driving on the right is reinforced by law\", \"priority\":12}]}, \"synonyms\":{}}");

	add("conventionalism", "{\"term\":\"conventionalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conventional|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Adherence to social conventions; conventional behavio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A conventional act or constrain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The doctrine that logical or mathematical principles are simply the expression of convention\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"but that we must have beliefs in order to carry on\", \"priority\":4}]}, \"synonyms\":{}}");

