	add("conversation", "{\"term\":\"conversation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027conversation\u0027 () from Latin {{m|la|conversātiōnem}}, accusative singular of {{m|la|conversātiō||conversation}}, from \u0027conversor\u0027 (abide, keep company with)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Expression and exchange of individual ideas through talking with other people; also, a set instance or occasion of such talking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1699\u0027\u0027, \u0027[http://essays.quotidiana.org/temple/heads_for_conversation/ Heads designed for an essay on conversations\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Study gives strength to the mind; \u0027\u0027conversation\u0027\u0027, grace: the first apt to give stiffness, the other suppleness: one gives substance and form to the statue, the other polishes it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dWhen this \u0027\u0027conversation\u0027\u0027 was repeated in detail within the hearing of the young woman in question, and undoubtedly for his benefit, Mr. Trevor threw shame to the winds and scandalized the Misses Brewster then and there by proclaiming his father to have been a country storekeeper\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAll this was extraordinarily distasteful to Churchill.Never before had he felt such repulsion when the vicar displayed his characteristic bluntness or coarseness of speech. In the present connexion\u0026amp;mdash;or rather as a transition from the subject that started their \u0027\u0027conversation\u0027\u0027\u0026amp;mdash;such talk had been distressingly out of place\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The back-and-forth play of the blades in a bout\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Interaction; commerce or intercourse with other people; dealing with others\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1526\u0027\u0027, trans. \u0027Bible\u0027, Acts XI\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Yt chaunsed thatt a whole yere they had their \u0027\u0027conversacion\u0027\u0027 with the congregacion there, and taught moche people insomoche thatt the disciples off Antioche we the fyrst that wer called Christen\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Behaviour, the way one conducts oneself; a person\u0027s way of life\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"New York Review of Books, 2001, p.50\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"There are many that take no heed what happeneth to others by bad \u0027\u0027conversation\u0027\u0027, and therefore overthrow themselves in the same manner through their own fault, not foreseeing dangers manifest\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"sexual Sexual intercourse\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1723\u0027\u0027, Charles Walker, \u0027Memoirs of the Life of Sally Salisbury\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"quitted her Lover , for the tumultuous \u0027\u0027Conversation\u0027\u0027 of\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, \u0027\u0027, Folio Society 1973, p. 333\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The landlady therefore would by no means have admitted any \u0027\u0027conversation\u0027\u0027 of a disreputable kind to pass under her roof\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The protocol-based interaction between systems processing a transaction\", \"priority\":18}]}, \"synonyms\":{}}");

	add("conversationalist", "{\"term\":\"conversationalist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who participates in a conversation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"If you can just ask questions about a person and nod sagely then they will leave thinking you are a brilliant \u0027\u0027conversationalist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person skilled in conversation, especially one who is not expert on the topic of conversation\", \"priority\":3}]}, \"synonyms\":{}}");

