	add("convert", "{\"term\":\"convert\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|wert}}From Old french (842-ca. 1400) \u0027convertir\u0027 () from Latin \u0027converto\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who has converted to his or her religion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They were all \u0027\u0027converts\u0027\u0027 to Islam\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ted Jones, \u0027The French Riviera: A Literary Guide for Travellers\u0027, Tauris Parke Paperbacks (2007), ISBN 9781845114558, chapter 3\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"While still in this relationship, Greene, a \u0027\u0027convert\u0027\u0027 to Roman Catholicism at 23, was asked to be godfather to Catherine Walston, a 30-year-old married woman, at her own conversion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who is now in favour of something that he or she previously opposed or disliked\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I never really liked broccoli before, but now that I\u0027ve tasted it the way you cook it, I\u0027m a \u0027\u0027convert\", \"priority\":6}]}, \"synonyms\":{}}");

