	add("conveyance", "{\"term\":\"conveyance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act or instance of conveying\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A manner of conveying one\u0027s thoughts, a style of communication\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1599\u0027\u0027, \u0027\u0027, s:Much Ado About Nothing Act 2 Scene\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She told me, not thinking I had been myself, that I was the prince\u0027s jester, that I was duller than a great thaw; huddling jest upon jest with such impossible \u0027\u0027conveyance\u0027\u0027 upon me, that I stood like a man at a mark, with a whole army shooting at me\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A means of transporting, especially a vehicle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Athelstan Arundel walked home all the way, foaming and raging. No omnibus, cab, or \u0027\u0027conveyance\u0027\u0027 ever built could contain a young man in such a rage. His mother lived at Pembridge Square, which is four good measured miles from Lincoln\u0027s Inn\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An instrument transferring title of an object from one person or group of persons to another\", \"priority\":7}]}, \"synonyms\":{}}");

	add("conveyancer", "{\"term\":\"conveyancer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|conveyance|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attorney who passes transfer of immovable property from one party to another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 \u0026quot;\u0027\u0027Conveyancers\u0027\u0027 in Cape Town are furious over long delays holding up the issue of rates clearance certificates by the City of Cape Town that are playing havoc with property transfers and deed registrations.\u0026quot; \u0027Weekend Argus June 24 2006\", \"priority\":2}]}, \"synonyms\":{}}");

