	add("conviction", "{\"term\":\"conviction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027conviction\u0027 from Latin \u0027convictio\u0027 () from \u0027convictus\u0027 () the past participle of \u0027convinco\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A firmly held belief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A judgement of guilt in a court of law\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being found or proved guilty\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of being convinced\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Daniel Taylor, \u0027Rickie Lambert\u0027s debut goal gives England victory over Scotland\u0027 (in \u0027The Guardian\u0027, 14 August 2013)[http://www.theguardian.com/football/2013/aug/14/england-scotland-international-friendly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The visitors were being pinned back by the end of the first half. Yet Gordon Strachan\u0027s side played with great \u0027\u0027conviction\u0027\u0027 and always had a chance of springing a surprise when their opponents were so susceptible at the back\", \"priority\":6}]}, \"synonyms\":{}}");

