	add("convocation", "{\"term\":\"convocation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027convocation\u0027 from Latin \u0027convocare\u0027 (to come together)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of calling or assembling by summons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An assembly or meeting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An assembly of the clergy, by their representatives, to consult on ecclesiastical affairs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An academical assembly, in which the business of the university is transacted\", \"priority\":4}]}, \"synonyms\":{}}");

	add("convolution", "{\"term\":\"convolution\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027convolutus\u0027 (to roll together) past participle of \u0027\u0027 from \u0027\u0027 + \u0027volvere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that is folded or twisted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of the folds on the surface of the brain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The shape of something rotating; a vortex\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A form of moving average\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A function which maps a tuple of sequences into a sequence of tuples\", \"priority\":5}]}, \"synonyms\":{}}");

